values (22, 'EL', 'EN', 'Includes: earbud headphones, USB 2.0 cable, dock adapter, case, iTunes for Windows and Mac, and more. Come one, come all and witness the incredible shrinking iPod! With the nano, Apple introduces the latest member of the highly successful iPod family of digital audio players. The nano is aptly named since it''s a fraction of the size of its larger iPod cousins. It is the width of a pencil and comes in at a feather-light 1.5 ounces. For Apple''s next trick, they''ve taken this new, diminutive iPod and added all of the features of a regular iPod. You get a bright, full-color display, Apple''s famous Click Wheel, and up to 14 hours of battery life. With that said, take a peek behind the curtain and be amazed at the rest of what the iPod nano has to offer: Connector for optional dock; stereo minijack; charge time: about 3 hours (1.5 hour fast charge to 80% capacity); AAC (16 to 320 Kbps); Protected AAC (from iTunes Music Store); MP3 (16 to 320 Kbps); MP3 VBR; Audible (formats 2, 3, and 4); Apple Lossless; WAV; AIFF; photo support: JPEG/BMP/GIF/TIFF/PSD (Mac only)/PNG; sync and charge via USB cable; adjust audiobook playback speed; create multiple on-the-go playlists; shuffle songs or albums; repeat one or all; 20 equalizer settings; backlight timer; display contrast; alarm; sleep timer; date and time; display time in menu bar; supports Windows 2000 with Service Pack 4 or later, Windows XP Home or Professional with Service Pack 2 or later, Mac OS X v10.3.4 or later; unit dimensions: 3.5 x 1.6 x 0.27; unit weight: 1.5 ounces. ', null, '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), 0);
insert into PRODUCT_TRANSLATIONS (product_id, language, source_lang, description, additional_info, created_by, creation_date, last_updated_by, last_update_date, object_version_id)
values (34, 'JA', 'EN', 'UIX''s A6 cameras come with very advanced features, but at a very affordable price. In addition to the true digital still picture color and sharpness you''d expect from this camera''s 6-megapixel image sensor, you also have a built-in Power Movie Clip function that lets you choose between 30 or 15 frames per second. And, it''s easy to double check your recently shot video with highly convenient pause, fast forward, and/or rewind right in the camera. The A6''s shutter button toggles between capture and playback modes, a great innovation for instant review of the pic you just took. Another one touch button allows you to take charge with manual, aperture priority, and shutter priority modes. Speaking of convenience, there''s even a built in mirror, so you can see how you look when you take your own picture! Select from six different image sizes from 640 by 480 pixels to 2,816 by 2,112 pixels and from three resolution ranges--superfine, fine, and normal for 18 different resolution/size combinations--a useful memory management tool.' || chr(10) || ' For example, you can take a postage stamp size picture from only 1.58 inches away in high resolution for wonderful color printing output, or a large but lower resolution landscape picture for full-screen sharing without choking friends'' e-mail. Samsung''s in-camera editing capabilities include the ability to crop, rotate, and make numerous color revisions. Included are ArcSoft Photo Impression, Digimax Viewer and Digimax Reader software for editing, storage and USB connection output to your PC or directly to your printer via the included USB cable.', null, '0', to_date('28-09-2013 20:54:43', 'dd-mm-yyyy hh24:mi:ss'), '0', to_date('28-09-2013 20:54:43', 'dd-mm-yyyy hh24:mi:ss'), 0);
insert into PRODUCT_TRANSLATIONS (product_id, language, source_lang, description, additional_info, created_by, creation_date, last_updated_by, last_update_date, object_version_id)
values (35, 'JA', 'EN', 'You''ll be amazed at the small, sleek form factor of the BlackBerry Pearl. It''s like no other BlackBerry. But it''s more than just a new look. This BlackBerry delivers everything its predecessors delivered and a whole lot more. The BlackBerry Pearl offers new features never before seen in a BlackBerry like, a 1.3 mega pixel camera, voice recognition, and an MP3 player to name a few. Try it for a few hours and you are hooked!', null, '0', to_date('28-09-2013 20:54:43', 'dd-mm-yyyy hh24:mi:ss'), '0', to_date('28-09-2013 20:54:43', 'dd-mm-yyyy hh24:mi:ss'), 0);
insert into PRODUCT_TRANSLATIONS (product_id, language, source_lang, description, additional_info, created_by, creation_date, last_updated_by, last_update_date, object_version_id)
values (36, 'JA', 'EN', 'Nintendo''s Wii video game system (pronounced "we") is designed to attract people, regardless of their age or video game experience, to sit down and play together--whether they''re in the same room or on different sides of the globe. The system''s name reflects this simple idea. It''s easily pronounced in a variety of languages, and the distinctive spelling suggests two players side by side. The two Wii features Nintendo thinks will create new levels of gaming community are built-in Wi-Fi access, supported by a new online gaming service, and Wii''s intuitive, wireless, motion-sensitive game controller.', 'MODEL- WII VENDOR- NINTENDO FEATURES- Wii Console The sleek Wii console, no larger than a stack of several DVD cases, includes Wii Sports, a sensor bar, an AV cable, a Wii stand, a Wii Remote, and a Nunchuk controller for even more exciting game- control possibilities. Featuring a remarkable wireless controller experience, the Nintendo Wii console invites players into game worlds and activities like never before. Whether theyre young or old, expert gamers or beginners, Wii players will express themselves with intuitive motion control using the Wii Remote: a flick of the wrist to swing a baseball bat or tennis racket, a backswing and follow-through to send a golf ball flying over a pristine fairway. Wii Sports, packaged with the Wii console, introduces players to those and many other experiences. Wii also taps into Nintendos unrivaled legacy of great games with the Virtual Console. Connecting via wireless broadband to Nintendo Wi-Fi Connection, Wii owners will be able to spend Virtual Console points to download selected classic games from NES, Super NES and N64 video game consoles. And through WiiConnect24, owners will be able to access even more content. Four-player compatibility as well as the ability to compete with other Wii players over broadband internet means that Wii offers a true social experience. * Design Featuring a compact design that makes it a natural addition to any television setup, the Wii console is white in color and can be displayed either vertically or horizontally. * GameCube Compatibility The Wii is backward-compatible to all Nintendo GameCube games', '0', to_date('28-09-2013 20:54:43', 'dd-mm-yyyy hh24:mi:ss'), '0', to_date('28-09-2013 20:54:43', 'dd-mm-yyyy hh24:mi:ss'), 0);
insert into PRODUCT_TRANSLATIONS (product_id, language, source_lang, description, additional_info, created_by, creation_date, last_updated_by, last_update_date, object_version_id)
values (37, 'JA', 'EN', 'To make gaming as accessible to people of all ages and all abilities, Nintendo wanted to create a controller that was as inviting as it was sophisticated. The outcome is the Wii Remote controller. Nintendo fused the familiarity of a remote control with the sophistication of motion-sensing technology to come up with an input device for the ages!Sporting the size of a traditional remote control, the wireless Wii Remote controller is a multifunctional device that is limited only by the game designer''s imagination. In a tennis game, it serves as your racket you swing with your arm. In a driving game, it serves as your steering wheel. For first-person shooters, the remote acts as your weapon that you point at an enemy. The list of potential uses goes on and on.Using Bluetooth technology, the wireless Wii Remote controller sends your actions to the Wii console from as far as 30 feet away. As a pointing device, the controller can send a signal from as far as 15 feet away. Up to four Wii Remote Controllers can be connected at once, making for some great multiplayer fun!', null, '0', to_date('28-09-2013 20:54:43', 'dd-mm-yyyy hh24:mi:ss'), '0', to_date('28-09-2013 20:54:43', 'dd-mm-yyyy hh24:mi:ss'), 0);
insert into PRODUCT_TRANSLATIONS (product_id, language, source_lang, description, additional_info, created_by, creation_date, last_updated_by, last_update_date, object_version_id)
values (38, 'JA', 'EN', 'EJB 3.0 has made huge advances in ease of development, and its drastically simplified programming model has been widely acclaimed. Targeted at Java and J2EE developers both with and without prior EJB experience, Beginning EJB 3 Application Development takes readers through the details of the EJB 3.0 architecture, and shows how EJB can be used to develop powerful, standards-based backend business logic. With 12 years of combined EJB experience, the authors offer many practical insights into the entire EJB architecture and cover all areas of the EJB 3.0 specification', null, '0', to_date('28-09-2013 20:54:43', 'dd-mm-yyyy hh24:mi:ss'), '0', to_date('28-09-2013 20:54:43', 'dd-mm-yyyy hh24:mi:ss'), 0);
insert into PRODUCT_TRANSLATIONS (product_id, language, source_lang, description, additional_info, created_by, creation_date, last_updated_by, last_update_date, object_version_id)
values (39, 'JA', 'EN', 'EJB 3.0 sets a new precedent. It has made huge advances in ease of development, and its drastically simplified programming model has been widely acclaimed. This book is the definitive guide to EJB 3.0 persistence technology. The authors provide unparalleled insight and expertise on this topic, fully examining and explaining EJB 3.0 persistence specification. They describe how to use this sophisticated technology to its full potential', null, '0', to_date('28-09-2013 20:54:43', 'dd-mm-yyyy hh24:mi:ss'), '0', to_date('28-09-2013 20:54:43', 'dd-mm-yyyy hh24:mi:ss'), 0);
insert into PRODUCT_TRANSLATIONS (product_id, language, source_lang, description, additional_info, created_by, creation_date, last_updated_by, last_update_date, object_version_id)
values (40, 'JA', 'EN', 'Get a thorough understanding of Oracle Database 10g from the most comprehensive Oracle database reference on the market, published by Oracle Press. From critical architecture concepts to advanced object-oriented concepts, this powerhouse contains nearly 50 chapters designed to enlighten you. Upgrade from earlier versions, use SQL, SQL Plus, and PL/SQL. Get code examples and access popular documentation PDFs--plus a full electronic copy of the book on the included CD-ROM.' || chr(10) || ' Go beyond the basics and learn security, text searches, external tables, using Java in Oracle, and a great deal more', null, '0', to_date('28-09-2013 20:54:43', 'dd-mm-yyyy hh24:mi:ss'), '0', to_date('28-09-2013 20:54:43', 'dd-mm-yyyy hh24:mi:ss'), 0);
insert into PRODUCT_TRANSLATIONS (product_id, language, source_lang, description, additional_info, created_by, creation_date, last_updated_by, last_update_date, object_version_id)
values (7, 'JA', 'EN', 'Xbox 360 sets a new pace for digital entertainment. More than just a cutting-edge game system, Xbox 360 also integrates high-definition video, DVD movie playback, digital music, photos, and online connectivity into one sleek, small tower.', 'Includes: Xbox 360 Console, 1 Wireless Xbox 360 Controller, Hard Drive, Headset, Standard A/V Cable, Faceplate, and Silver Xbox Live.The Xbox 360 System is the way to begin experiencing the ultimate in next-generation gaming. Amazing Digital entertainment experiences, unprecedented in home console entertainment, are waiting for you -- all you have to do is connect the controller to this incredible device and an unsurpassed level of adventure and excitement is yours.' || chr(10) || ' Connect up to 4 wireless game controllers Online optimization - The XBox 360 is Wi-Fi ready (802.11a, b and g), has a built-in Ethernet port and has out-of-the-box access to Xbox Live Full digital media support - Plays DVD-Video, DVD-ROM, DVD-R/RW, DVD+R/RW, CD-DA, CD-ROM, CD-R, CD-RW, WMA CD, MP3 CD, JPEG Photo CD Streams media from portable MP3 players or a Windows XP based PC 3 USB 2.0 ports, two memory unit slots Multi-channel Surround sound, Supports 48KHz 16-Bit Audio Stands vertically or horizontally Interchangeable face plates personalize your XBox 360 console Dimensions(HxWxD) - 3.27 x 12.17 x 10.16 (83 x 309 x 258 mm) Weight - 7.7 lbs (3.49 Kg)', '0', to_date('28-09-2013 20:54:43', 'dd-mm-yyyy hh24:mi:ss'), '0', to_date('28-09-2013 20:54:43', 'dd-mm-yyyy hh24:mi:ss'), 0);
insert into PRODUCT_TRANSLATIONS (product_id, language, source_lang, description, additional_info, created_by, creation_date, last_updated_by, last_update_date, object_version_id)
values (8, 'JA', 'EN', 'The era of no-compromises handheld gaming has arrived. Get ready for immersive, 3D gaming on a console that is poised to change the way we think about portable devices. With wireless internet, video and digital music playback, and incredible data storage and connectivity options, the Sony PSP--or PlayStation Portable--is a complete solution for the mobile digital lifestyle. Sony has hit the mark by combining both horsepower and groundbreaking features into a package that weighs just a hair more than half a pound.', 
        'The awe and excitement that has made Sony Playstation so popular as a TV game now lets you take it on the road and do more than you magined. The PSP is more than a portable version of Playstation. It''s a portable entertainment center with MP3 and MP4 download and play capabilities. This nearly pocketable portable has a built-in, bright, high-resolution 4.3 inch (diagonal) color TFT LCD widescreen (for 16:9 perspective), built-in stereo speakers, and amazing connectivity. With an integrated 802.11b WiFi processor, you can share your online games over wireless networks - where available. In addition to playing exciting games exclusively designed for the PSP on its UMD drive, there are also a number of movies available. UMD is a small, high-capacity optical disc that allows up to 1.8 GB - providing an extremely versatile format for games, music, and video. A built-in USB 2.0 slot enables computer connectivity for downloading music as ATRAC and MP3 files, video as MP4 files, photos as JPEG and online connectivity. Files may also be stored on MemoryStick Duo digital-media cards. Built-in stereo speakers Input / Output Connectivity - 1 audio out, 1 microphone in, 1 control connector, 1 x USB 2.0, 1 Memory Stick Pro Duo slot, IrDA wireless, IR remote (allows simultaneous multiple PSPs to be connected) / Integrated Communications - 802.11b Wi-Fi Sony Proprietary UMD Drive Power - PSP''s battery is a removable, rechargeable lithium-ion battery. It''s possible to charge the PSP while using the system Control Buttons - Square, Triangle, X, and Circle face buttons, a digital pad, start, select, an analog thumb stick and two shoulder buttons on the top / Brightness control and Sound mode selectors. Built-in copyright protection system utilizes a combination of a unique disc ID, a 128-bit AES encryption key for media, and individual ID for each PSP unit', '0', to_date('28-09-2013 20:54:43', 'dd-mm-yyyy hh24:mi:ss'), '0', to_date('28-09-2013 20:54:43', 'dd-mm-yyyy hh24:mi:ss'), 0);
insert into PRODUCT_TRANSLATIONS (product_id, language, source_lang, description, additional_info, created_by, creation_date, last_updated_by, last_update_date, object_version_id)
values (9, 'JA', 'EN', 'Lighter, brighter and just as fun as the original Nintendo DS, the Nintendo DS Lite arrives just in time for hungry gamers. It''s smaller than the original DS, with brighter screens and adjustable backlighting. The DS Lite sets itself apart from every other hand-held gaming system on the market with a variety of new features. Center microphone Larger stylus for a better grip Easy-to-reach Start and Select buttons Removable cover keeps the Game Boy Advance cartridge slot clear from dust and debris when not in use Color - Polar White', null, '0', to_date('28-09-2013 20:54:43', 'dd-mm-yyyy hh24:mi:ss'), '0', to_date('28-09-2013 20:54:43', 'dd-mm-yyyy hh24:mi:ss'), 0);
insert into PRODUCT_TRANSLATIONS (product_id, language, source_lang, description, additional_info, created_by, creation_date, last_updated_by, last_update_date, object_version_id)
values (14, 'JA', 'EN', 'Streamlined and sophisticated, the Bluetooth Headset H500 provides wireless connectivity and convenience. Combining an ergonomic design and versatile ear hook, this sleek headset can be worn on either ear. Created to be ultra comfortable, the Motorola H500 is so easy to wear that you''ll forget you even have it on! But don''t be fooled by its good looks - this petite powerhouse provides impressive battery power to boot and an omni-directional microphone to clearly pick up your voice. A perfect companion for a variety of Bluetooth compatible 1.2- and 1.1-enabled mobile phones, the Motorola H500 is a must-have accessory for communicating in style. The Motorola H500 works with you to help you communicate on the go - connecting with devices up to 30 feet away. Or give your mobile a rest and connect with your Bluetooth-enabled PC for hands-free Voice over IP VoIP use. Offering improved comfort and sound quality over its predecessor, the Motorola H500 provides a sleek, ergonomic design that fits to your ear, allowing for comfortable wear over extended periods and providing an enhanced seal for outstanding audio performance. Style and comfort are only part of this package - the headset boasts up to 8 hours of talk time or 130 hours of standby time from a single charge, giving you plenty of juice for all of your wireless connections! Whether you are managing the office or party planning on-the-go, the Motorola H500 is perfect for multi-tasking with flair. Equipped with a multifunction button it''s easy to place, receive or end calls - all from one button! Advanced volume controls include orientation technology to assure that volume controls will always be upright Blue LED light to notify when the headset is in use, or turn off this feature if you choose Bluetooth 1.2 provides quicker pairing, better audio with less dropped calls and reduced interference from other devices Skype certified', null, '0', to_date('28-09-2013 20:54:43', 'dd-mm-yyyy hh24:mi:ss'), '0', to_date('28-09-2013 20:54:43', 'dd-mm-yyyy hh24:mi:ss'), 0);
insert into PRODUCT_TRANSLATIONS (product_id, language, source_lang, description, additional_info, created_by, creation_date, last_updated_by, last_update_date, object_version_id)
values (15, 'JA', 'EN', 'The Portable Audio System for iPod and iPod Photo allows you to play your iPod through a portable speaker system. Just put your iPod in the dock, then press play. It''s that easy. The revolutionary MaxxBass technology creates quality bass without a subwoofer, and the built-in docking station provides the same synchronization, data transfer, and recharging options as your iPod dock. The convenient secondary input jack provides for connection with other audio devices, including laptops, older iPods, and other MP3 players. The IM3C fits, syncs, and charges the iPod, iPod photo, iPod mini, and iPod nano players.', null, '0', to_date('28-09-2013 20:54:43', 'dd-mm-yyyy hh24:mi:ss'), '0', to_date('28-09-2013 20:54:43', 'dd-mm-yyyy hh24:mi:ss'), 0);
insert into PRODUCT_TRANSLATIONS (product_id, language, source_lang, description, additional_info, created_by, creation_date, last_updated_by, last_update_date, object_version_id)
values (16, 'JA', 'EN', 'The Creative Zen Vision W Multimedia Player lets you take all your movies, music and photos in a light, pocket-sized device that is loaded with 30 or 60 GB of memory. At this capacity you can carry tens of thousands of photos, 240 hours of movies (500 Kbps MPEG4-SP), or up to 30,000 songs (WMA encoded at 64 Kbps), all in the palm of your hand. You can also tune in the radio (32 station presets), record your favorite talk show, or make personal voice memos with the built-in microphone. And the big news about the Vision W is that it displays your media in a widescreen, 16:9 format.', null, '0', to_date('28-09-2013 20:54:43', 'dd-mm-yyyy hh24:mi:ss'), '0', to_date('28-09-2013 20:54:43', 'dd-mm-yyyy hh24:mi:ss'), 0);
