insert into PRODUCT_TRANSLATIONS (product_id, language, source_lang, description, additional_info, created_by, creation_date, last_updated_by, last_update_date, object_version_id)
values (18, 'JA', 'EN', 'The Apple 1 GB Shuffle is the world''s smallest digital music player that lets you wear up to 240 songs on your sleeve, or your lapel, or your belt--it''s so small you can wear it just about anywhere. Clip on iPod Shuffle and wear it as a badge of musical devotion. And with the shuffle''s anodized aluminum enclosure it is durable and goes with almost any outfit. About the size of a matchbook, the iPod Shuffle measures up nicely. Just clip it and go. It comes with a teeny little docking station. Although the Shuffle comes in a small package, 1.62 inches long and about half an ounce, it still holds a lot of music, and you can count on your Shuffle to keep on rocking for up to 12 continuous hours.' || chr(10) || ' Use iTunes to import your CDs, shop for songs on the iTunes Store, and then sync them to your iPod Shuffle. And if you have more than 240 songs in your iTunes library, let iTunes autofill your Shuffle and get a new musical experience every time.', null, '0', to_date('28-09-2013 20:54:43', 'dd-mm-yyyy hh24:mi:ss'), '0', to_date('28-09-2013 20:54:43', 'dd-mm-yyyy hh24:mi:ss'), 0);
