values (23, 'JA', 'EN', 'Includes: earbud headphones, USB 2.0 cable, dock adapter, case, iTunes for Windows and Mac, and more. Come one, come all and witness the incredible shrinking iPod! With the nano, Apple introduces the latest member of the highly successful iPod family of digital audio players. The nano is aptly named since it''s a fraction of the size of its larger iPod cousins. It is the width of a pencil and comes in at a feather-light 1.5 ounces. For Apple''s next trick, they''ve taken this new, diminutive iPod and added all of the features of a regular iPod. You get a bright, full-color display, Apple''s famous Click Wheel, and up to 14 hours of battery life. With that said, take a peek behind the curtain and be amazed at the rest of what the iPod nano has to offer: Connector for optional dock; stereo minijack; charge time: about 3 hours (1.5 hour fast charge to 80% capacity); AAC (16 to 320 Kbps); Protected AAC (from iTunes Music Store); MP3 (16 to 320 Kbps); MP3 VBR; Audible (formats 2, 3, and 4); Apple Lossless; WAV; AIFF; photo support: JPEG/BMP/GIF/TIFF/PSD (Mac only)/PNG; sync and charge via USB cable; adjust audiobook playback speed; create multiple on-the-go playlists; shuffle songs or albums; repeat one or all; 20 equalizer settings; backlight timer; display contrast; alarm; sleep timer; date and time; display time in menu bar; supports Windows 2000 with Service Pack 4 or later, Windows XP Home or Professional with Service Pack 2 or later, Mac OS X v10.3.4 or later; unit dimensions: 3.5 x 1.6 x 0.27; unit weight: 1.5 ounces. ', null, '0', to_date('28-09-2013 20:54:43', 'dd-mm-yyyy hh24:mi:ss'), '0', to_date('28-09-2013 20:54:43', 'dd-mm-yyyy hh24:mi:ss'), 0);
insert into PRODUCT_TRANSLATIONS (product_id, language, source_lang, description, additional_info, created_by, creation_date, last_updated_by, last_update_date, object_version_id)
values (24, 'JA', 'EN', 'The world''s best-designed and easiest-to-use desktop just got faster. Now with the Intel Core Duo processor with two execution cores on a single chip--iMac brings a new generation of power to the amazing things it can do.', 'Includes: Apple Remote, Apple Keyboard, Mighty Mouse, Mac OS X v10.4 Tiger, iLife ''06, Front Row, and Photo Booth.' || chr(10) || ' Apple iMac with Intel Core Duo - Never judge a book by it''s cover. A very appropriate phrase when talking about the new Apple iMac. On the outside it looks identical to the previous iMac desktop computer. The difference now lies at the heart of the latest iteration of the iMac. Powering the new all-in-one desktop is an Intel Core Duo! Dual processors on a single chip that gives you double the speed of the old iMac. With the new iMac you also get unique software applications. iLife ''06 is a suite of applications that will make your everyday life easier to manage than ever before. And Front Row, combined with the included remote, lets you enjoy the media on your iMac from any seat in the house. Slot-loading 8x SuperDrive with 2.4x Dual Layer burning Write Speeds - up to 2.4x Dual Layer DVD+R, 8x DVD+R, 8x DVD-R, 4x DVD+RW, 4x DVD-RW, 24x CD-R, 8x CD-RW Read Speeds - up to 8x DVD-ROM, 24x CD-ROM Built-in 17 widescreen TFT active-matrix LCD Native Resolution - 1440x900 Built-in iSight webcam ATI Radeon X1600 graphics with 128MB of GDDR3 memory Ports - 10/100/1000Base-T Ethernet, 2 Firewire 400, 3 USB 2.0, 2 USB 1.1 (1 on keyboard), mini-DVI, DVI Out, VGA Out, S-Video Out, and Composite Out Built-in AirPort Extreme 802.11g Wi-Fi wireless network adapter Built-in Bluetooth 2.0+EDR Module Unit Weight - approx. 15.5 lbs.', '0', to_date('28-09-2013 20:54:43', 'dd-mm-yyyy hh24:mi:ss'), '0', to_date('28-09-2013 20:54:43', 'dd-mm-yyyy hh24:mi:ss'), 0);
