values (26, 'JA', 'EN', 'Live the digital life in stylish simplicity--up to five times faster. Just 6.5 inches square and 2 i nches small, Mac mini lets you have more fun with your music, photos and movies, more quickly and mo re easily. Enjoy them up close or far away with the included Apple Remote. The most affordable way t o Intel Core Duo, iLife ’06, and Front Row.', 'Apple MA607LL/A Mac mini Desktop Computer - Apple is known around the world for its innovative computer design, and with the Mac mini they give you a powerful desktop computer in a case that''s roughly the size of a lunchbox. But this is the best looking lunchbox you''ve ever seen, with its sleek, anodized aluminum enclosure, slot-loading optical drive and an array of ports on the rear section that makes cable management a breeze. Inside the Mac mini, you''ll find a powerful Intel Core Duo Processor 1.66GHz, 512MB of PC2-5300 DDR2 SDRAM, a 60GB SATA Hard Drive, and much more. 60GB 5400RPM SATA HDD Slot-Loading DVD-ROM/CD-RW Combo Drive - (write speeds) up to 24x CD-R and 16x CD-RW Slot-Loading DVD-ROM/CD-RW Combo Drive - (read speeds) up to 8x DVD-ROM and 24x CD-ROM Intel GMA 950 graphics processor with 64MB of shared memory (memory is shared with the main system) Ports - 10/100/1000 Gigabit Ethernet, 1 FireWire 400, 4 USB 2.0, 1 DVI Out, 1 VGA Out (w/ included adapter), 1 S-Video and Composite Video Out, combined Optical Digital Audio In/Audio Line In, and Combined Optical Digital Audio Out/Headphone Out Built-in Speakers Built-in AirPort Extreme 802.11g Wi-Fi Wireless Network Adapter Built-in Bluetooth 2.0+EDR (Enhanced Data Rate) module Unit Dimensions - 2 (h) x 6.5 (w) x 6.5 (d) Unit Weight - 2.9 lbs.', '0', to_date('28-09-2013 20:54:43', 'dd-mm-yyyy hh24:mi:ss'), '0', to_date('28-09-2013 20:54:43', 'dd-mm-yyyy hh24:mi:ss'), 0);
insert into PRODUCT_TRANSLATIONS (product_id, language, source_lang, description, additional_info, created_by, creation_date, last_updated_by, last_update_date, object_version_id)
values (27, 'JA', 'EN', 'Miraculously engineered, the ultralight 17-inch PowerBook G4 is a mere 1-inch thin and only 6.9 pounds, making it one of the planet''s thinnest, lightest, 17-inch notebooks. The first thing you''ll notice is the megawide display -- the largest ever in a notebook. This PowerBook''s stunning display gives you the same viewing area as a 19-inch CRT monitor. And as for the amount of information you can see on the screen at one time, the 17-inch PowerBook supports a resolution of 1440 x 900 pixels -- an eye-popping 1.3 million pixels appearing on the screen simultaneously, with room aplenty for your menus, toolbars and palettes. Thanks to its built-in, dual-link DVI support and 128 MB of graphics memory, you even have the option of connecting your PowerBook to Apple''s breathtaking flat-panel displays, including the massive 30-inch Apple Cinema HD Display. Featuring a powerful 1.67 GHz PowerPC G4 processor, a standard 5400-rpm 100 GB hard drive, an 8x SuperDrive, up to 2 GB of DDR RAM and AirPort Extreme and Bluetooth 2.0+EDR built right in, the top gun of notebook computers has it all.', 
        'Includes: lithium-ion battery, AC adapter, S-Video to Composite adapter, DVI to VGA adapter, iLife, iSync, and more. Apple 17" PowerBook Computer - This notebook computer comes packed with unique and convenient features that will greatly enhance your mobile computing experience. Built-in AirPort Extreme is a great feature to help keep you connected on the road. Wherever there''s a Wi-Fi Hot Spot, you can wirelessly surf the Internet and check e-mail. And if there''s no Wi-Fi around, you can use a Bluetooth-enabled cell phone as a modem, thanks to built-in Bluetooth 2.0 support. With Bluetooth 2.0, you can also use it along with iSync, to keep your contacts and schedules up to date. Not to mention enjoying a cable-free experience with an optional Apple wireless keyboard and mouse! Another really unique feature is the trackpad. Unlike other trackpads, this trackpad lets you easily scroll through web pages and large documents using a unique 2-finger method. ATI Mobility Radeon 9700 with 128MB of DDR SDRAM and dual-link DVI 100GB 5400RPM HDD SuperDrive - up to 8x DVD-R, 4x DVD-RW, 8x DVD+R, 4x DVD+RW, 24x CD-R, 10x CD-RW, 24x CD-ROM, and 8x DVD-ROM Built-in Gigabit Ethernet - 10/100/1000 Built-in 802.11g AirPort Extreme Built-in Bluetooth 2.0+EDR (Enhanced Data Rate) Built-in 56k v.92 Fax Modem Full size illuminated keyboard with ambient light sensor Unit Dimensions - 1 (h) x 15.4 (w) x 10.2 (d) Unit Weight - 6.9 lbs.', '0', to_date('28-09-2013 20:54:43', 'dd-mm-yyyy hh24:mi:ss'), '0', to_date('28-09-2013 20:54:43', 'dd-mm-yyyy hh24:mi:ss'), 0);
insert into PRODUCT_TRANSLATIONS (product_id, language, source_lang, description, additional_info, created_by, creation_date, last_updated_by, last_update_date, object_version_id)
values (10, 'EL', 'EN', 'Zune is here. Designed around the principles of sharing, discovery and community, Zune will create new ways for people to connect and share entertainment experiences. The Zune experience centers around connection-- connection to your library, connection to friends, connection to community and connection to other devices. Zune starts with a 30GB digital media player and adds a twist. You can wirelessly share selected full-length sample tracks, playlists, pictures or your home-grown tracks directly from Zune to Zune. The Zune has arrived, sporting sharing features that may revolutionize the way we experience music. You can listen to the full-length songs that you receive up to three times in three days, flag the ones you like and easily buy them the next time you sync up. You can discover new music in the Zune Marketplace, and show off your favorite pictures and videos on the big, bright screen. Zune stores up to 7,500 songs, 25,000 pictures or 100 hours of video. You can make playlists on the go and watch a slide show while you''re listening. Watching video in landscape mode gets the most out of the vivid display. Zune has all that and a built in FM tuner, too. Zune comes in three colors: black, brown and white.', 
        'The Digital Media Player reinvented. With the new Microsoft Zune you can wirelessly share selected full-length sample tracks, playlists, pictures or your home-grown tracks directly from Zune to Zune. Listen to those received full-length songs up to three times in three days, with the option to flag the ones you like to easily purchase them the next time you sync up. Browse the Zune Marketplace for access to millions of songs, old and new. Use the bright 3" LCD screen to watch your favorite videos or browse pictures of your family and friends. 30GB of storage means plenty of space for your music, photos, and videos. Never grow tired of your music with a built-in FM tuner for access to local FM radio broadcasts. Reinvent your digital media experience with the Microsoft Zune! Import unprotected music, photos and videos in WMA, MP3, AAC, JPEG, WMV, MPEG-4, H.264 from iTunes and Windows Media Player Purchase music from the continually updated Zune Marketplace using 79 Microsoft Points to purchase individual songs, or use a Zune Pass subscription for unlimited access to millions of songs for just $14.99 a month (Microsoft Points cards sold separately for purchasing music without a credit card) Optional Zune Car Pack allows you to play your tunes in your car with an FM transmitter with AutoSeek and Car Charger (Sold separately) Easily update your Zune via your PC when updates become available to add more features! Up to 12 hour battery life playing music with WiFi off Dimensions - 4.4 x 2.4 x 0.58 Weight - 5.6 ounces 1 Year limited manufacturer''s warranty Requires Windows XP with Service Pack 2 and High Speed Internet Connectivity', '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), 0);
insert into PRODUCT_TRANSLATIONS (product_id, language, source_lang, description, additional_info, created_by, creation_date, last_updated_by, last_update_date, object_version_id)
values (11, 'EL', 'EN', 'Thin is definitely in. At just over a half-inch thick, the Motorola RAZR V3 is the perfect combination of sleek design and powerful features. And now you can get it dressed in gorgeous black. This special edition version kicks the style up a notch and demands attention. With long-range Bluetooth, support for video playback, a VGA (640 x 480) camera and a gorgeous color screen, the RAZR V3 is everything you''re looking for in a stylish mobile companion. Get the most out of your Cingular service with this impressive quad-band phone.', 'The Moto Razr V3 is expertly crafted to deliver exceptional performance. Inside the ultra-thin design are advanced features like MPEG4 video playback, Bluetooth® wireless technology, a digital camera and more. And with the precision-cut keypad, minimalist styling and metal finish, the V3 looks just as beautiful as it performs. The real difference is in the details. See who’s calling, in color, without opening your phone — the large internal display is complemented by an impressive external display. The precision-cut metal keypad reacts to the lightest of touches. And the features you can''t always see are equally impressive, like quad-band GSM — for global calls where GSM network coverage and roaming agreements are present.', '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), 0);
