values (12, 'EL', 'EN', 'The Creative Nomad MuVo² combines cutting-edge, high-capacity 1-inch hard disk drive storage, high-speed loading, and superb sound quality in a remarkably compact, easy-to-use package. Load up to 2,100 songs (based on 3.5 minutes per song, WMA/64 kbps with 4 GB storage) with simple plug-and-play, drag-and-drop functionality. Transfer any music or data files in a flash with super-fast USB 2.0. Enjoy high-fidelity sound with specifications unmatched by other MP3 and WMA players. The Nomad MuVo² is a perfect blend of capacity, style, versatility, and ease of use in a tiny player for the active music lover. Grab it, load it, and you''re all set to go!', 'The Creative NOMAD MuVo? combines cutting-edge high capacity 1" hard disk drive storage, high-speed loading and superb sound quality in a remarkably compact, easy to use package. Load up to 2100 songs (based on 3.5 min per song, WMA / 64kbps with 4GB storage) with simple plug-and-play, drag-and-drop functionality. Transfer any music or data files in a flash with super fast USB2.0. Enjoy high fidelity sound with specifications unmatched by other MP3 and WMA players. The NOMAD MuVo? is a perfect blend of capacity, style, versatility and ease of use in a tiny player for the active music lover. Grab it, load it, clip it on your belt and you''re all set to go!', '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), 0);
