values (13, 'EL', 'EN', 'SyNEt''s TBW-101UB Bluetooth USB Adapter allows you to make short-range wireless connections between your computer and Bluetooth enabled devices such as Cellular Phone, PDA, and Computer. It is compact and portable, eliminating the need for cables and physical connections between electronic devices. The Bluetooth USB Adapter transmission ensures both protection from interference and secured data transfers. Simply plug the USB Adapter into the USB port and enjoy the freedom and flexibility of Bluetooth wireless technology.', null, '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), 0);
