values (31, 'EL', 'EN', 'The simple to use Kodi EasyShare C743 zoom digital camera provides remarkable features at a reasonable price. You''ll bring details to life with 7.1-megapixel resolution. And the C743 has a 3x optical zoom lens and a huge 2.4-inch color display, proving that impressive doesn''t always need to be expensive.', 'The simple to use Kodak EasyShare C743 zoom digital camera provides remarkable features at a reasonable price. You''ll bring details to life with 7.1 Megapixel and the C743 has a 3x optical zoom lens, huge 2.5 inch color display. Capture life in motion with continuous VGA video 640x480 at 30 fps, featuring audio capture and playback. Create your perfect picture without a computer, using on-camera cropping. Know your pictures are in focus with the blurry picture alert feature. Restore an unintentionally deleted picture with the undo-delete function. Automatically reduce red-eye during picture capture with digital red-eye reduction. The C743 is part of the Kodak EasyShare system, so printing and sharing your pictures is amazingly simple. Shutter speed - 4-1/1400 seconds, long exposure 4 seconds max 2.5 inch LCD indoor/outdoor color display Optical Real Image Viewfinder Self timer - 2 and 10 seconds, 2 shot and burst Scene modes - auto, portrait, sport, landscape, night portrait, snow, beach, fireworks, self portrait, close up, backlight, children, party Still format - JPEG/EXIF v 2.21 QuickTime MOV MPEG-4 format with audio recording during capture NTSC or PAL I/O interface Tripod mount 1/4 inch standard System requirements - Windows XP, 2000 SP4 or later, 600 MHz processor or greater; Internet Explorer 6.0 or higher, Macintosh OS X 10.3 or higher; Safari 1.1 or higher, 128 MB RAM, 200 MB hard drive disk space available, CD-ROM drive, available USB port, color monitor, 800 x 600 display resolution, 16-bit minimum Unit Dimensions - Width 3.6 x Height 2.3 x Depth 1.3 inch, 92.2 x 65.7 x 32.4 mm Weight without batteries - 145 grams (5.1 ounces)', '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), 0);
