values (18, 'FR', 'EN', 'The Apple 1 GB Shuffle is the world''s smallest digital music player that lets you wear up to 240 songs on your sleeve, or your lapel, or your belt--it''s so small you can wear it just about anywhere. Clip on iPod Shuffle and wear it as a badge of musical devotion. And with the shuffle''s anodized aluminum enclosure it is durable and goes with almost any outfit. About the size of a matchbook, the iPod Shuffle measures up nicely. Just clip it and go. It comes with a teeny little docking station. Although the Shuffle comes in a small package, 1.62 inches long and about half an ounce, it still holds a lot of music, and you can count on your Shuffle to keep on rocking for up to 12 continuous hours.' || chr(10) || ' Use iTunes to import your CDs, shop for songs on the iTunes Store, and then sync them to your iPod Shuffle. And if you have more than 240 songs in your iTunes library, let iTunes autofill your Shuffle and get a new musical experience every time.', null, '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), 0);
insert into PRODUCT_TRANSLATIONS (product_id, language, source_lang, description, additional_info, created_by, creation_date, last_updated_by, last_update_date, object_version_id)
values (23, 'FR', 'EN', 'Includes: earbud headphones, USB 2.0 cable, dock adapter, case, iTunes for Windows and Mac, and more. Come one, come all and witness the incredible shrinking iPod! With the nano, Apple introduces the latest member of the highly successful iPod family of digital audio players. The nano is aptly named since it''s a fraction of the size of its larger iPod cousins. It is the width of a pencil and comes in at a feather-light 1.5 ounces. For Apple''s next trick, they''ve taken this new, diminutive iPod and added all of the features of a regular iPod. You get a bright, full-color display, Apple''s famous Click Wheel, and up to 14 hours of battery life. With that said, take a peek behind the curtain and be amazed at the rest of what the iPod nano has to offer: Connector for optional dock; stereo minijack; charge time: about 3 hours (1.5 hour fast charge to 80% capacity); AAC (16 to 320 Kbps); Protected AAC (from iTunes Music Store); MP3 (16 to 320 Kbps); MP3 VBR; Audible (formats 2, 3, and 4); Apple Lossless; WAV; AIFF; photo support: JPEG/BMP/GIF/TIFF/PSD (Mac only)/PNG; sync and charge via USB cable; adjust audiobook playback speed; create multiple on-the-go playlists; shuffle songs or albums; repeat one or all; 20 equalizer settings; backlight timer; display contrast; alarm; sleep timer; date and time; display time in menu bar; supports Windows 2000 with Service Pack 4 or later, Windows XP Home or Professional with Service Pack 2 or later, Mac OS X v10.3.4 or later; unit dimensions: 3.5 x 1.6 x 0.27; unit weight: 1.5 ounces. ', null, '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), 0);
insert into PRODUCT_TRANSLATIONS (product_id, language, source_lang, description, additional_info, created_by, creation_date, last_updated_by, last_update_date, object_version_id)
values (24, 'FR', 'EN', 'The world''s best-designed and easiest-to-use desktop just got faster. Now with the Intel Core Duo processor with two execution cores on a single chip--iMac brings a new generation of power to the amazing things it can do.', 'Includes: Apple Remote, Apple Keyboard, Mighty Mouse, Mac OS X v10.4 Tiger, iLife ''06, Front Row, and Photo Booth.' || chr(10) || ' Apple iMac with Intel Core Duo - Never judge a book by it''s cover. A very appropriate phrase when talking about the new Apple iMac. On the outside it looks identical to the previous iMac desktop computer. The difference now lies at the heart of the latest iteration of the iMac. Powering the new all-in-one desktop is an Intel Core Duo! Dual processors on a single chip that gives you double the speed of the old iMac. With the new iMac you also get unique software applications. iLife ''06 is a suite of applications that will make your everyday life easier to manage than ever before. And Front Row, combined with the included remote, lets you enjoy the media on your iMac from any seat in the house. Slot-loading 8x SuperDrive with 2.4x Dual Layer burning Write Speeds - up to 2.4x Dual Layer DVD+R, 8x DVD+R, 8x DVD-R, 4x DVD+RW, 4x DVD-RW, 24x CD-R, 8x CD-RW Read Speeds - up to 8x DVD-ROM, 24x CD-ROM Built-in 17 widescreen TFT active-matrix LCD Native Resolution - 1440x900 Built-in iSight webcam ATI Radeon X1600 graphics with 128MB of GDDR3 memory Ports - 10/100/1000Base-T Ethernet, 2 Firewire 400, 3 USB 2.0, 2 USB 1.1 (1 on keyboard), mini-DVI, DVI Out, VGA Out, S-Video Out, and Composite Out Built-in AirPort Extreme 802.11g Wi-Fi wireless network adapter Built-in Bluetooth 2.0+EDR Module Unit Weight - approx. 15.5 lbs.', '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), 0);
insert into PRODUCT_TRANSLATIONS (product_id, language, source_lang, description, additional_info, created_by, creation_date, last_updated_by, last_update_date, object_version_id)
values (25, 'FR', 'EN', 'The world''s best-designed and easiest-to-use desktop just got faster. Now with the Intel Core Duo processor with two execution cores on a single chip--iMac brings a new generation of power to the amazing things it can do.', 'Includes: Apple Remote, Apple Keyboard, Mighty Mouse, Mac OS X v10.4 Tiger, iLife ''06, Front Row, and Photo Booth.' || chr(10) || ' Apple iMac with Intel Core Duo - Never judge a book by it''s cover. A very appropriate phrase when talking about the new Apple iMac. On the outside it looks identical to the previous iMac desktop computer. The difference now lies at the heart of the latest iteration of the iMac. Powering the new all-in-one desktop is an Intel Core Duo! Dual processors on a single chip that gives you double the speed of the old iMac. With the new iMac you also get unique software applications. iLife ''06 is a suite of applications that will make your everyday life easier to manage than ever before. And Front Row, combined with the included remote, lets you enjoy the media on your iMac from any seat in the house. Slot-loading 8x SuperDrive with 2.4x Dual Layer burning Write Speeds - up to 2.4x Dual Layer DVD+R, 8x DVD+R, 8x DVD-R, 4x DVD+RW, 4x DVD-RW, 24x CD-R, 8x CD-RW Read Speeds - up to 8x DVD-ROM, 24x CD-ROM Built-in 17 widescreen TFT active-matrix LCD Native Resolution - 1440x900 Built-in iSight webcam ATI Radeon X1600 graphics with 128MB of GDDR3 memory Ports - 10/100/1000Base-T Ethernet, 2 Firewire 400, 3 USB 2.0, 2 USB 1.1 (1 on keyboard), mini-DVI, DVI Out, VGA Out, S-Video Out, and Composite Out Built-in AirPort Extreme 802.11g Wi-Fi wireless network adapter Built-in Bluetooth 2.0+EDR Module Unit Weight - approx. 15.5 lbs.', '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), 0);
insert into PRODUCT_TRANSLATIONS (product_id, language, source_lang, description, additional_info, created_by, creation_date, last_updated_by, last_update_date, object_version_id)
values (26, 'FR', 'EN', 'Live the digital life in stylish simplicity--up to five times faster. Just 6.5 inches square and 2 i nches small, Mac mini lets you have more fun with your music, photos and movies, more quickly and mo re easily. Enjoy them up close or far away with the included Apple Remote. The most affordable way t o Intel Core Duo, iLife ’06, and Front Row.', 'Apple MA607LL/A Mac mini Desktop Computer - Apple is known around the world for its innovative computer design, and with the Mac mini they give you a powerful desktop computer in a case that''s roughly the size of a lunchbox. But this is the best looking lunchbox you''ve ever seen, with its sleek, anodized aluminum enclosure, slot-loading optical drive and an array of ports on the rear section that makes cable management a breeze. Inside the Mac mini, you''ll find a powerful Intel Core Duo Processor 1.66GHz, 512MB of PC2-5300 DDR2 SDRAM, a 60GB SATA Hard Drive, and much more. 60GB 5400RPM SATA HDD Slot-Loading DVD-ROM/CD-RW Combo Drive - (write speeds) up to 24x CD-R and 16x CD-RW Slot-Loading DVD-ROM/CD-RW Combo Drive - (read speeds) up to 8x DVD-ROM and 24x CD-ROM Intel GMA 950 graphics processor with 64MB of shared memory (memory is shared with the main system) Ports - 10/100/1000 Gigabit Ethernet, 1 FireWire 400, 4 USB 2.0, 1 DVI Out, 1 VGA Out (w/ included adapter), 1 S-Video and Composite Video Out, combined Optical Digital Audio In/Audio Line In, and Combined Optical Digital Audio Out/Headphone Out Built-in Speakers Built-in AirPort Extreme 802.11g Wi-Fi Wireless Network Adapter Built-in Bluetooth 2.0+EDR (Enhanced Data Rate) module Unit Dimensions - 2 (h) x 6.5 (w) x 6.5 (d) Unit Weight - 2.9 lbs.', '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), 0);
insert into PRODUCT_TRANSLATIONS (product_id, language, source_lang, description, additional_info, created_by, creation_date, last_updated_by, last_update_date, object_version_id)
values (5, 'FR', 'EN', 'The sleek and powerful Palm Tungsten E handheld comes packed for business and priced for value.Access your calendar, contacts and important information anywhere. Create and edit Word, Excel and PowerPoint-compatible files on the run. Synchronize with Outlook''s calendar, contacts, tasks, notes and email right out of the box. Stay productive using updated features to Palm''s award winning organization software. Listen to MP3s, watch video clips and view photos wherever you go.A powerful ARM processor lets you listen to MP3s while looking up an address or scheduling an appointment. Watch the latest movie trailer or a new sales video. Carry digital photo albums of friends and family, students and co-workers, even the latest real estate listings. Plus it''s expandable, and with 32MB of memory there''s plenty of room to customize from more than 18,000 applications (sold separately).', null, '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), 0);
insert into PRODUCT_TRANSLATIONS (product_id, language, source_lang, description, additional_info, created_by, creation_date, last_updated_by, last_update_date, object_version_id)
values (6, 'FR', 'EN', 'This is the original XBOX Microsoft video game system, delivering the most powerful games experiences ever. Xbox empowers game artists by giving them the technology to fulfill their creative visions as never before, creating games that blur the lines between fantasy and reality. The Xbox video game system and controller are designed to capture the power and performance that Xbox will deliver and are based on the input of more than 5,000 gamers and games creators from around the world. Sleek and powerful in its look, in a rich shade of black, the Xbox video game system is emblazoned with a large "X" and a signature green Xbox "jewel" positioned in its center. Four game controller ports that allow easy multiplayer gaming and enable other peripherals, ranging from game pads to voice-activated headsets. A front-loading DVD tray. A multisignal audio-video connector that allows for easy hookup to televisions and home theater systems. An Ethernet port for rich, fast-action online gaming via a broadband connection. An NVIDIA graphics processing unit (GPU), delivering superior graphic performance. An Intel 733MHz processor, the most powerful CPU of any console. An internal hard drive, for massive storage of game information - a first in the console gaming industry.', null, '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), 0);
insert into PRODUCT_TRANSLATIONS (product_id, language, source_lang, description, additional_info, created_by, creation_date, last_updated_by, last_update_date, object_version_id)
values (7, 'FR', 'EN', 'Xbox 360 sets a new pace for digital entertainment. More than just a cutting-edge game system, Xbox 360 also integrates high-definition video, DVD movie playback, digital music, photos, and online connectivity into one sleek, small tower.', 'Includes: Xbox 360 Console, 1 Wireless Xbox 360 Controller, Hard Drive, Headset, Standard A/V Cable, Faceplate, and Silver Xbox Live.The Xbox 360 System is the way to begin experiencing the ultimate in next-generation gaming. Amazing Digital entertainment experiences, unprecedented in home console entertainment, are waiting for you -- all you have to do is connect the controller to this incredible device and an unsurpassed level of adventure and excitement is yours.' || chr(10) || ' Connect up to 4 wireless game controllers Online optimization - The XBox 360 is Wi-Fi ready (802.11a, b and g), has a built-in Ethernet port and has out-of-the-box access to Xbox Live Full digital media support - Plays DVD-Video, DVD-ROM, DVD-R/RW, DVD+R/RW, CD-DA, CD-ROM, CD-R, CD-RW, WMA CD, MP3 CD, JPEG Photo CD Streams media from portable MP3 players or a Windows XP based PC 3 USB 2.0 ports, two memory unit slots Multi-channel Surround sound, Supports 48KHz 16-Bit Audio Stands vertically or horizontally Interchangeable face plates personalize your XBox 360 console Dimensions(HxWxD) - 3.27 x 12.17 x 10.16 (83 x 309 x 258 mm) Weight - 7.7 lbs (3.49 Kg)', '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), 0);
insert into PRODUCT_TRANSLATIONS (product_id, language, source_lang, description, additional_info, created_by, creation_date, last_updated_by, last_update_date, object_version_id)
values (8, 'FR', 'EN', 'The era of no-compromises handheld gaming has arrived. Get ready for immersive, 3D gaming on a console that is poised to change the way we think about portable devices. With wireless internet, video and digital music playback, and incredible data storage and connectivity options, the Sony PSP--or PlayStation Portable--is a complete solution for the mobile digital lifestyle. Sony has hit the mark by combining both horsepower and groundbreaking features into a package that weighs just a hair more than half a pound.', 
        'The awe and excitement that has made Sony Playstation so popular as a TV game now lets you take it on the road and do more than you magined. The PSP is more than a portable version of Playstation. It''s a portable entertainment center with MP3 and MP4 download and play capabilities. This nearly pocketable portable has a built-in, bright, high-resolution 4.3 inch (diagonal) color TFT LCD widescreen (for 16:9 perspective), built-in stereo speakers, and amazing connectivity. With an integrated 802.11b WiFi processor, you can share your online games over wireless networks - where available. In addition to playing exciting games exclusively designed for the PSP on its UMD drive, there are also a number of movies available. UMD is a small, high-capacity optical disc that allows up to 1.8 GB - providing an extremely versatile format for games, music, and video. A built-in USB 2.0 slot enables computer connectivity for downloading music as ATRAC and MP3 files, video as MP4 files, photos as JPEG and online connectivity. Files may also be stored on MemoryStick Duo digital-media cards. Built-in stereo speakers Input / Output Connectivity - 1 audio out, 1 microphone in, 1 control connector, 1 x USB 2.0, 1 Memory Stick Pro Duo slot, IrDA wireless, IR remote (allows simultaneous multiple PSPs to be connected) / Integrated Communications - 802.11b Wi-Fi Sony Proprietary UMD Drive Power - PSP''s battery is a removable, rechargeable lithium-ion battery. It''s possible to charge the PSP while using the system Control Buttons - Square, Triangle, X, and Circle face buttons, a digital pad, start, select, an analog thumb stick and two shoulder buttons on the top / Brightness control and Sound mode selectors. Built-in copyright protection system utilizes a combination of a unique disc ID, a 128-bit AES encryption key for media, and individual ID for each PSP unit', '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), 0);
insert into PRODUCT_TRANSLATIONS (product_id, language, source_lang, description, additional_info, created_by, creation_date, last_updated_by, last_update_date, object_version_id)
values (9, 'FR', 'EN', 'Lighter, brighter and just as fun as the original Nintendo DS, the Nintendo DS Lite arrives just in time for hungry gamers. It''s smaller than the original DS, with brighter screens and adjustable backlighting. The DS Lite sets itself apart from every other hand-held gaming system on the market with a variety of new features. Center microphone Larger stylus for a better grip Easy-to-reach Start and Select buttons Removable cover keeps the Game Boy Advance cartridge slot clear from dust and debris when not in use Color - Polar White', null, '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), 0);
insert into PRODUCT_TRANSLATIONS (product_id, language, source_lang, description, additional_info, created_by, creation_date, last_updated_by, last_update_date, object_version_id)
values (42, 'EL', 'EN', 'It is not possible to fit 36 Bach masterpieces on two CDs, so what Essential Bach does is present individual movements from across a range of the composer''s work. The anthology is clearly aimed at the newcomer, and the absence of booklet notes to put the music in context is disappointing. We are only given titles, performers, and what films the extracts have been featured in, from Rollerball to The English Patient. On the plus side, most if not all of the music is instantly recognizable, by melody if not by name. Everything from the Brandenburg Concertos to "Air on a G String" to the B Minor Mass and St. Matthew Passion is represented. Performances range from 1960 to 1993, encompassing both early instrument and modern orchestra interpretations by a wide variety of forces, including Sir Neville Marriner with the Academy of St. Martin in the Fields and Raymond Leppard leading the English Chamber Orchestra. Given such diversity the result is unavoidably a patchwork, albeit one made from the finest materials, and as such is perhaps best treated as a sampler to aid exploration of the vast legacy of one of the very greatest composers who ever lived. ', null, '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), 0);
insert into PRODUCT_TRANSLATIONS (product_id, language, source_lang, description, additional_info, created_by, creation_date, last_updated_by, last_update_date, object_version_id)
values (43, 'EL', 'EN', 'These are thoroughly balanced and lovingly conceived performances. They reveal great strength of character, healthy self-control and mature insight. Ferencsik evidently had experienced much, with emotional and spiritual roots that went deep. Consequently he had no need to resort to surface, superficial excitement to compensate for lack of insight. Ferencsik reveals the mature insight that comes only from a life-long contemplation of scores that the conductor knew as well as he knew the date of his own birthday.', null, '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), 0);
insert into PRODUCT_TRANSLATIONS (product_id, language, source_lang, description, additional_info, created_by, creation_date, last_updated_by, last_update_date, object_version_id)
values (44, 'EL', 'EN', 'This 2CDs set is quite a good compilation of arias from Mozart''s best known operas. The cast is awesome, too. The trouble is Mozart wrote so many wonderful arias that when you try to compile them from many operas, lots of the great ones like ''Non piu di fiori'' and ''Deh per questo istante solo'' from La clemenza di Tito get left out (tho having Teresa Berganza''s version of ''Parto ma tu ben mio'' makes up for it somewhat). A lot of chorus pieces from Idomeneo but none of Idamante''s arias, no Elettra''s famous rage aria, and no ''Traurigkeit'' from ''Die Entfuehrung''? Bottom line, all the arias included are marvellously sung. I think the line up could have been better, tho. It won''t fill you up, perhaps, but it will wet your appetite for complete set of the operas included.', null, '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), 0);
insert into PRODUCT_TRANSLATIONS (product_id, language, source_lang, description, additional_info, created_by, creation_date, last_updated_by, last_update_date, object_version_id)
values (45, 'EL', 'EN', 'In this recording we hear one of the great piano performers in Vladimir Ashkenazy playing pieces from one of the greatest piano composers in Fryderyk Chopin; with the utmost quality in recorded sound. And if one needs more convincing, you get two hours of music for the price of one cd. Hard to find a better buy in classical music. Moreover, this cd not only looks good on paper, but it also is one of my favorites to listen to. I usually listen to music to help enrich and exonerate an otherwise mundane (computer) task, and I find myself stopping work several times each listen because I''m overcome by the beauty of these pieces, and the both spirited and soulful playing of Ashkenazy. For anyone new to Chopin, I cannot think of a better starting point (no, this double cd does not cover all his great compositions!) than this recording.', null, '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), 0);
insert into PRODUCT_TRANSLATIONS (product_id, language, source_lang, description, additional_info, created_by, creation_date, last_updated_by, last_update_date, object_version_id)
values (46, 'EL', 'EN', 'We haven''t had a disc of Tchaikovsky ballet excerpts from the Vienna Phil., I believe, since Karajan''s four decades ago (a great recording on Decca in plush remastered sound). Here under James Levine in 1992 the orchestra is even better--more fluid, sparkling and alive than under Karajan. This is well-worn music that every collector already owns, and it''s easy to overlook Levine as a Tchaikovsky conductor.' || chr(10) || ' Here he defies all expectations. True, he doesn''t take a balletic aproach. Levine''s tempos in general are too fast to dance to. But in the symphonic vein he has chosen, Levine works miracles. The urgent virtuosity of the playing--aided by excellent recorded sound--is jaw-dropping, and the violin soloist in the long Swan Lake scene (#4) is beyond compare for delicacy and poetry. Karajan''s only fault in this music wass to blow it up out of proportion; Previn''s was to apply routine phrasing.' || chr(10) || ' Levine makes these suites totally riveting and sensuously luxurious without any trace of pomposity. Highly recommended.', null, '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), 0);
insert into PRODUCT_TRANSLATIONS (product_id, language, source_lang, description, additional_info, created_by, creation_date, last_updated_by, last_update_date, object_version_id)
values (47, 'EL', 'EN', 'CD 1 THE THREE GREAT SYMPHONIES CD 1 Symphony No. 7 in D Minor, Op. 70 q. I. Allegro maestoso 2. Poco adagio 3. Scherzo: Vivance 4. Finale: Allegro Symphony No. 8 in G Mahor, Op. 88 5. Allegro con brio 6. Adagio 7. Allegretto grazioso 8. Allegro, ma non troppo CD 2. Symphony No. 9 in E Minor, Op. 95 1. Adagio; allegro molto 2. Largo 3. Scherzo: Molto vivace 4. Alllegro con fuoco 5. Scherzo capriccioso, Op. 66.', null, '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), 0);
insert into PRODUCT_TRANSLATIONS (product_id, language, source_lang, description, additional_info, created_by, creation_date, last_updated_by, last_update_date, object_version_id)
values (19, 'FR', 'EN', 'Apple iPod - Continuing its tradition of hardware and software innovation and design, Apple has released a new iPod that surpasses the last. This update to the 5th generation iPod with video playback features a huge 80GB hard drive - the largest yet! With iTunes 7 ushering in movie and game downloads, there''s more than enough content to satisfy this beast of a media player. You also get a 2.5" display that is now 60% brighter, a higher capacity battery for up to 20 hrs. of music and 6.5 hrs. of video, and a set of newly designed iPod earbuds. Ports - dock connector, Stereo minijack, composite video and audio through minijack Connectivity - USB through dock connector, composite video (with A/V cable - sold separately), and audio through headphone jack or line out on the iPod Universal Dock (sold separately) Charge Time - about 4 hrs. (2 hrs. fast charge to 80% capacity) Audio Support - AAC (16 to 320 Kbps), Protected AAC (from iTunes Music Store), MP3 (16 to 320 Kbps), MP3 VBR, Audible (formats 2, 3, and 4), Apple Lossless, WAV, and AIFF Photo Support - syncs iPod-viewable photos in JPEG, BMP, GIF, TIFF, PSD (Mac only), and PNG formats Video Support - H.264 video - up to 768 Kbps, 320 x 240, 30 fps, Baseline Profile up to Level 1.3 with AAC-LC up to 160 Kbps, 48 Khz, stereo audio in. m4v,. mp4 and. mov file formats / MPEG-4 video - up to 2.5 mbps, 480 x 480, 30 fps, Simple Profile with AAC-LC up to 160 Kbps, 48 Khz, stereo audio in. m4v,. mp4 and. mov file formats Backlight Timer Sleep Timer 20 Equalizer Settings Shuffle Songs or Albums Date and Time Unit Dimensions - 4.1 x 2.4 x 0.55 Unit Weight - 5.5 oz.', null, '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), 0);
