values (20, 'FR', 'EN', 'Apple iPod - Continuing its tradition of hardware and software innovation and design, Apple has released a new iPod that surpasses the last. This update to the 5th generation iPod with video playback features a huge 80GB hard drive - the largest yet! With iTunes 7 ushering in movie and game downloads, there''s more than enough content to satisfy this beast of a media player. You also get a 2.5" display that is now 60% brighter, a higher capacity battery for up to 20 hrs. of music and 6.5 hrs. of video, and a set of newly designed iPod earbuds. Ports - dock connector, Stereo minijack, composite video and audio through minijack Connectivity - USB through dock connector, composite video (with A/V cable - sold separately), and audio through headphone jack or line out on the iPod Universal Dock (sold separately) Charge Time - about 4 hrs. (2 hrs. fast charge to 80% capacity) Audio Support - AAC (16 to 320 Kbps), Protected AAC (from iTunes Music Store), MP3 (16 to 320 Kbps), MP3 VBR, Audible (formats 2, 3, and 4), Apple Lossless, WAV, and AIFF Photo Support - syncs iPod-viewable photos in JPEG, BMP, GIF, TIFF, PSD (Mac only), and PNG formats Video Support - H.264 video - up to 768 Kbps, 320 x 240, 30 fps, Baseline Profile up to Level 1.3 with AAC-LC up to 160 Kbps, 48 Khz, stereo audio in. m4v,. mp4 and. mov file formats / MPEG-4 video - up to 2.5 mbps, 480 x 480, 30 fps, Simple Profile with AAC-LC up to 160 Kbps, 48 Khz, stereo audio in. m4v,. mp4 and. mov file formats Backlight Timer Sleep Timer 20 Equalizer Settings Shuffle Songs or Albums Date and Time Unit Dimensions - 4.1 x 2.4 x 0.55 Unit Weight - 5.5 oz.', null, '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), 0);
insert into PRODUCT_TRANSLATIONS (product_id, language, source_lang, description, additional_info, created_by, creation_date, last_updated_by, last_update_date, object_version_id)
values (21, 'FR', 'EN', 'Includes: earbud headphones, USB 2.0 cable, dock adapter, case, iTunes for Windows and Mac, and more. Come one, come all and witness the incredible shrinking iPod! With the nano, Apple introduces the latest member of the highly successful iPod family of digital audio players. The nano is aptly named since it''s a fraction of the size of its larger iPod cousins. It is the width of a pencil and comes in at a feather-light 1.5 ounces. For Apple''s next trick, they''ve taken this new, diminutive iPod and added all of the features of a regular iPod. You get a bright, full-color display, Apple''s famous Click Wheel, and up to 14 hours of battery life. With that said, take a peek behind the curtain and be amazed at the rest of what the iPod nano has to offer: Connector for optional dock; stereo minijack; charge time: about 3 hours (1.5 hour fast charge to 80% capacity); AAC (16 to 320 Kbps); Protected AAC (from iTunes Music Store); MP3 (16 to 320 Kbps); MP3 VBR; Audible (formats 2, 3, and 4); Apple Lossless; WAV; AIFF; photo support: JPEG/BMP/GIF/TIFF/PSD (Mac only)/PNG; sync and charge via USB cable; adjust audiobook playback speed; create multiple on-the-go playlists; shuffle songs or albums; repeat one or all; 20 equalizer settings; backlight timer; display contrast; alarm; sleep timer; date and time; display time in menu bar; supports Windows 2000 with Service Pack 4 or later, Windows XP Home or Professional with Service Pack 2 or later, Mac OS X v10.3.4 or later; unit dimensions: 3.5 x 1.6 x 0.27; unit weight: 1.5 ounces. ', null, '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), 0);
