insert into PRODUCT_TRANSLATIONS (product_id, language, source_lang, description, additional_info, created_by, creation_date, last_updated_by, last_update_date, object_version_id)
values (1, 'DE', 'EN', 'The TH-42PX60U 42-inch Diagonal Plasma HDTV gives you deep blacks, bright whites and 29 billion colors -- it''s an image so close to real life, you''ll swear you were in your favorite programs instead of just watching them. Enjoy crisp, lifelike details with the up to 10,0001 contrast ratio.' || chr(10) || ' Deep blacks provide excellent shadow detail during dark scenes, while brilliant whites render bright scenes with vivid realism. Receive and view local over-the-air broadcasts in stunning HDT, using the built-in HDTV tuner. You can even share your JPEG photos taken with the built-in SD card slot. Features a width-to-height ratio similar to movie theater screens, providing a theater-like experience at home. View HDTV broadcasts and widescreen DVDs the way they were meant to be seen. Native Resolution - 1366 x 768 Contrast Ratio - Up to 10,000 - 1 Progressive Scan Video Noise Reduction Digital Comb Filter Color Purity Optimizer (3D Color Management) Two 20-watt, 8 ohm speakers -- 70Hz - 17kHz, 10% THD Surround Sound Motion Pattern Noise Reduction BBE ViVA HD3D Sound Standard NTSC tuner ATSC/QAM (SDTV and HDTV broadcasts) SD Card Slot and Photo Viewer HDMI-HDCP Interface - 2, in rear Analog Audio Input (for HDMI) - 1 rear Composite Video Input - 3 (2 rear, 1 front) S-Video Inputs - 3 (2 rear, 1 front)' || chr(10) || ' Audio Input (for Video) - 3 (2 rear, 1 front) Rear Inputs/Outputs - 2 Component Video (YPbPr), 2 Component Audio out, 1 Composite and Audio out On-screen display languages - English/Spanish/French Timers - Sleep/On/Off Built-in closed-caption decoder Video Input Labeling V-Chip Program Lockout Includes remote control and pedestal stand Unit Dimensions(HxWxD) - 27.8 x 40.2 x 3.7 Unit Weight - 65 lbs', 
        'HDMI (High-Definition Multimedia Interface) is a lossless, uncompressed, all-digital audio/video interface to link any AV source with an audio and/or video monitor, such as a digital television (DTV). HDMI supports standard-definition (SD), enhanced definition (ED), or high-definition (HD) video, plus multi-channel digital audio--all using a single cable.' || chr(10) || ' If a component doesn''t have an HDMI connection, you''ll also get great picture reproduction using the three-jack component video (Y/Pb/Pr) input, which provides separate connections for luminance (Y), blue color difference (PB) and red color difference (PR). This results in increased bandwidth for color information, resulting in a more accurate picture with clearer color reproduction and less bleeding than you would get with S-Video or composite (RCA yellow video plug) connections. Component video output is available only for DVD playback.', '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), 0);
insert into PRODUCT_TRANSLATIONS (product_id, language, source_lang, description, additional_info, created_by, creation_date, last_updated_by, last_update_date, object_version_id)
values (2, 'DE', 'EN', 'Whether you''re a die-hard PlayStation 2 fan or a new player, this totally redesigned PlayStation 2 console will meet the demands of your game playing. The internal design architecture has been completely overhauled. Internal volume has been reduced by 75 percent, the system''s overall weight and thickness has been reduced incredibly. The smaller, sleeker design makes it easy to carry around and enjoy games any time, anywhere. It keeps the PS2''s powerful 300MHz processor, for enhanced clarity and mesmerizing graphics. Also comes with one standard PS2 controller.', 'MODEL- 97064 VENDOR- SONY PLAYSTATION FEATURES- PlayStation 2 Compact System- Charcoal Black Smaller, Slimmer and Network Ready PlayStation 2! While inheriting the basic functions and design philosophy of the current PlayStation 2 (SCPH-50000), the internal design architecture of the new redesigned PlayStation 2 computer entertainment system (SCPH-70000 CB) model has been completely overhauled, resulting in a slimmer and more lightweight form. Internal volume has been reduced by 75 percent, overall weight has been halved, and thickness trimmed down to 2.8 cm (thickness of current model is 7.8cm). Its size is almost as small as a hardcover book, making it easier to carry around. Equipped with an integrated Ethernet port for network gaming, the PlayStation 2 sets new standards in the fusion of design and functionality. Approximately 40 percent of North American PlayStation 2 online gamers use dial-up connections and to satisfy this base, the North American model is equipped with both Ethernet and modem ports. Includes PlayStation 2 console, Analog Controller (DUALSHOCK 2), AV Cable (integrated audio/video), AC Adaptor (AC power cord included). -- SPECIFICATIONs -- CPU - CPU : 128-bit CPU System Clock Frequency : 294.912 MHz Cache Memory : Instruction: 16KB, Data: 8KB + 16 K (ScrP) Main Memory : Direct Rambus (Direct RDRAM) Memory Size : 32MB Memory Bus Bandw', '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), 0);
insert into PRODUCT_TRANSLATIONS (product_id, language, source_lang, description, additional_info, created_by, creation_date, last_updated_by, last_update_date, object_version_id)
values (3, 'DE', 'EN', 'The unlocked PalmOne Treo 650 boasts all the legendary features of the venerable Treo 600, plus a whole lot more. Now with Bluetooth, a higher resolution screen, a removable battery, and an improved keyboard, the Treo 650 is once again on the cutting edge of Smartphone technology. It offers all the functionality of a high-end Palm OS-powered PDA, a cell phone and a VGA camera. Simply put, it''s the ultimate mobile office companion.', 'Get All You Need, All In One Treo 650 PDA Unlocked GSM Phone The Treo™ 650 smartphone from palmOne makes it easier than ever to stay connected. It simplifies your life by combining a compact mobile phone with email, an organizer, messaging, and web access. There’s also Bluetooth® technology so you can connect wirelessly to other Bluetooth devices. Not to mention an MP3 player, a digital camera that captures video, and a vibrant color screen that brings everything to life – all in a device that’s still small enough to fit in your pocket. Seems like Treo smartphones just keep getting smarter. The Treo 650 smartphone looks and feels just like a phone, but it’s so much more. Carry thousands of business and personal phone numbers with you, and dial any of them by name from your contacts list. Or enter a name or number on the QWERTY keyboard. There’s even an on-screen dial pad. Speakerphone, speed dial, conference calling, call history, and caller ID make managing all your calls that much easier. Available as a dual-band digital CDMA phone, and as a GSM quad-band world phone. The included VersaMail® email client makes it easy to access and manage your email on the go – whether you use a popular desktop email client, IMAP or POP3. View photos, HTML, and even native Microsoft Word, Excel, and PowerPoint attachments. Synchronize your corporate Microsoft Exchange email and calendar with built-in Microsoft Exchange ActiveSync®', '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), 0);
insert into PRODUCT_TRANSLATIONS (product_id, language, source_lang, description, additional_info, created_by, creation_date, last_updated_by, last_update_date, object_version_id)
values (4, 'DE', 'EN', 'The Palm® Treo™ 700w smartphone delivers everything you need without compromise. It combines a smarter phone with broadband-like speeds2 and rich-media capabilities, all in one—bringing Palm''s world-class ease of use to the Windows Mobile® platform. Connect with people in multiple ways—by voice, email, SMS, or MMS3. Your contacts are always reachable, from any application. Access email, the web, and corporate networks on one of the fastest networks available in the U.S.2, 3 Or relax and play your favorite music and videos right on your device. With this easy-to-use productivity device in hand, you can stay connected3 on your terms.', null, '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), 0);
insert into PRODUCT_TRANSLATIONS (product_id, language, source_lang, description, additional_info, created_by, creation_date, last_updated_by, last_update_date, object_version_id)
values (5, 'DE', 'EN', 'The sleek and powerful Palm Tungsten E handheld comes packed for business and priced for value.Access your calendar, contacts and important information anywhere. Create and edit Word, Excel and PowerPoint-compatible files on the run. Synchronize with Outlook''s calendar, contacts, tasks, notes and email right out of the box. Stay productive using updated features to Palm''s award winning organization software. Listen to MP3s, watch video clips and view photos wherever you go.A powerful ARM processor lets you listen to MP3s while looking up an address or scheduling an appointment. Watch the latest movie trailer or a new sales video. Carry digital photo albums of friends and family, students and co-workers, even the latest real estate listings. Plus it''s expandable, and with 32MB of memory there''s plenty of room to customize from more than 18,000 applications (sold separately).', null, '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), 0);
insert into PRODUCT_TRANSLATIONS (product_id, language, source_lang, description, additional_info, created_by, creation_date, last_updated_by, last_update_date, object_version_id)
values (6, 'DE', 'EN', 'This is the original XBOX Microsoft video game system, delivering the most powerful games experiences ever. Xbox empowers game artists by giving them the technology to fulfill their creative visions as never before, creating games that blur the lines between fantasy and reality. The Xbox video game system and controller are designed to capture the power and performance that Xbox will deliver and are based on the input of more than 5,000 gamers and games creators from around the world. Sleek and powerful in its look, in a rich shade of black, the Xbox video game system is emblazoned with a large "X" and a signature green Xbox "jewel" positioned in its center. Four game controller ports that allow easy multiplayer gaming and enable other peripherals, ranging from game pads to voice-activated headsets. A front-loading DVD tray. A multisignal audio-video connector that allows for easy hookup to televisions and home theater systems. An Ethernet port for rich, fast-action online gaming via a broadband connection. An NVIDIA graphics processing unit (GPU), delivering superior graphic performance. An Intel 733MHz processor, the most powerful CPU of any console. An internal hard drive, for massive storage of game information - a first in the console gaming industry.', null, '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), 0);
insert into PRODUCT_TRANSLATIONS (product_id, language, source_lang, description, additional_info, created_by, creation_date, last_updated_by, last_update_date, object_version_id)
values (7, 'DE', 'EN', 'Xbox 360 sets a new pace for digital entertainment. More than just a cutting-edge game system, Xbox 360 also integrates high-definition video, DVD movie playback, digital music, photos, and online connectivity into one sleek, small tower.', 'Includes: Xbox 360 Console, 1 Wireless Xbox 360 Controller, Hard Drive, Headset, Standard A/V Cable, Faceplate, and Silver Xbox Live.The Xbox 360 System is the way to begin experiencing the ultimate in next-generation gaming. Amazing Digital entertainment experiences, unprecedented in home console entertainment, are waiting for you -- all you have to do is connect the controller to this incredible device and an unsurpassed level of adventure and excitement is yours.' || chr(10) || ' Connect up to 4 wireless game controllers Online optimization - The XBox 360 is Wi-Fi ready (802.11a, b and g), has a built-in Ethernet port and has out-of-the-box access to Xbox Live Full digital media support - Plays DVD-Video, DVD-ROM, DVD-R/RW, DVD+R/RW, CD-DA, CD-ROM, CD-R, CD-RW, WMA CD, MP3 CD, JPEG Photo CD Streams media from portable MP3 players or a Windows XP based PC 3 USB 2.0 ports, two memory unit slots Multi-channel Surround sound, Supports 48KHz 16-Bit Audio Stands vertically or horizontally Interchangeable face plates personalize your XBox 360 console Dimensions(HxWxD) - 3.27 x 12.17 x 10.16 (83 x 309 x 258 mm) Weight - 7.7 lbs (3.49 Kg)', '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), 0);
insert into PRODUCT_TRANSLATIONS (product_id, language, source_lang, description, additional_info, created_by, creation_date, last_updated_by, last_update_date, object_version_id)
values (8, 'DE', 'EN', 'The era of no-compromises handheld gaming has arrived. Get ready for immersive, 3D gaming on a console that is poised to change the way we think about portable devices. With wireless internet, video and digital music playback, and incredible data storage and connectivity options, the Sony PSP--or PlayStation Portable--is a complete solution for the mobile digital lifestyle. Sony has hit the mark by combining both horsepower and groundbreaking features into a package that weighs just a hair more than half a pound.', 
        'The awe and excitement that has made Sony Playstation so popular as a TV game now lets you take it on the road and do more than you magined. The PSP is more than a portable version of Playstation. It''s a portable entertainment center with MP3 and MP4 download and play capabilities. This nearly pocketable portable has a built-in, bright, high-resolution 4.3 inch (diagonal) color TFT LCD widescreen (for 16:9 perspective), built-in stereo speakers, and amazing connectivity. With an integrated 802.11b WiFi processor, you can share your online games over wireless networks - where available. In addition to playing exciting games exclusively designed for the PSP on its UMD drive, there are also a number of movies available. UMD is a small, high-capacity optical disc that allows up to 1.8 GB - providing an extremely versatile format for games, music, and video. A built-in USB 2.0 slot enables computer connectivity for downloading music as ATRAC and MP3 files, video as MP4 files, photos as JPEG and online connectivity. Files may also be stored on MemoryStick Duo digital-media cards. Built-in stereo speakers Input / Output Connectivity - 1 audio out, 1 microphone in, 1 control connector, 1 x USB 2.0, 1 Memory Stick Pro Duo slot, IrDA wireless, IR remote (allows simultaneous multiple PSPs to be connected) / Integrated Communications - 802.11b Wi-Fi Sony Proprietary UMD Drive Power - PSP''s battery is a removable, rechargeable lithium-ion battery. It''s possible to charge the PSP while using the system Control Buttons - Square, Triangle, X, and Circle face buttons, a digital pad, start, select, an analog thumb stick and two shoulder buttons on the top / Brightness control and Sound mode selectors. Built-in copyright protection system utilizes a combination of a unique disc ID, a 128-bit AES encryption key for media, and individual ID for each PSP unit', '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), 0);
insert into PRODUCT_TRANSLATIONS (product_id, language, source_lang, description, additional_info, created_by, creation_date, last_updated_by, last_update_date, object_version_id)
values (9, 'DE', 'EN', 'Lighter, brighter and just as fun as the original Nintendo DS, the Nintendo DS Lite arrives just in time for hungry gamers. It''s smaller than the original DS, with brighter screens and adjustable backlighting. The DS Lite sets itself apart from every other hand-held gaming system on the market with a variety of new features. Center microphone Larger stylus for a better grip Easy-to-reach Start and Select buttons Removable cover keeps the Game Boy Advance cartridge slot clear from dust and debris when not in use Color - Polar White', null, '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), 0);
insert into PRODUCT_TRANSLATIONS (product_id, language, source_lang, description, additional_info, created_by, creation_date, last_updated_by, last_update_date, object_version_id)
values (10, 'DE', 'EN', 'Zune is here. Designed around the principles of sharing, discovery and community, Zune will create new ways for people to connect and share entertainment experiences. The Zune experience centers around connection-- connection to your library, connection to friends, connection to community and connection to other devices. Zune starts with a 30GB digital media player and adds a twist. You can wirelessly share selected full-length sample tracks, playlists, pictures or your home-grown tracks directly from Zune to Zune. The Zune has arrived, sporting sharing features that may revolutionize the way we experience music. You can listen to the full-length songs that you receive up to three times in three days, flag the ones you like and easily buy them the next time you sync up. You can discover new music in the Zune Marketplace, and show off your favorite pictures and videos on the big, bright screen. Zune stores up to 7,500 songs, 25,000 pictures or 100 hours of video. You can make playlists on the go and watch a slide show while you''re listening. Watching video in landscape mode gets the most out of the vivid display. Zune has all that and a built in FM tuner, too. Zune comes in three colors: black, brown and white.', 
        'The Digital Media Player reinvented. With the new Microsoft Zune you can wirelessly share selected full-length sample tracks, playlists, pictures or your home-grown tracks directly from Zune to Zune. Listen to those received full-length songs up to three times in three days, with the option to flag the ones you like to easily purchase them the next time you sync up. Browse the Zune Marketplace for access to millions of songs, old and new. Use the bright 3" LCD screen to watch your favorite videos or browse pictures of your family and friends. 30GB of storage means plenty of space for your music, photos, and videos. Never grow tired of your music with a built-in FM tuner for access to local FM radio broadcasts. Reinvent your digital media experience with the Microsoft Zune! Import unprotected music, photos and videos in WMA, MP3, AAC, JPEG, WMV, MPEG-4, H.264 from iTunes and Windows Media Player Purchase music from the continually updated Zune Marketplace using 79 Microsoft Points to purchase individual songs, or use a Zune Pass subscription for unlimited access to millions of songs for just $14.99 a month (Microsoft Points cards sold separately for purchasing music without a credit card) Optional Zune Car Pack allows you to play your tunes in your car with an FM transmitter with AutoSeek and Car Charger (Sold separately) Easily update your Zune via your PC when updates become available to add more features! Up to 12 hour battery life playing music with WiFi off Dimensions - 4.4 x 2.4 x 0.58 Weight - 5.6 ounces 1 Year limited manufacturer''s warranty Requires Windows XP with Service Pack 2 and High Speed Internet Connectivity', '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), 0);
insert into PRODUCT_TRANSLATIONS (product_id, language, source_lang, description, additional_info, created_by, creation_date, last_updated_by, last_update_date, object_version_id)
values (11, 'DE', 'EN', 'Thin is definitely in. At just over a half-inch thick, the Motorola RAZR V3 is the perfect combination of sleek design and powerful features. And now you can get it dressed in gorgeous black. This special edition version kicks the style up a notch and demands attention. With long-range Bluetooth, support for video playback, a VGA (640 x 480) camera and a gorgeous color screen, the RAZR V3 is everything you''re looking for in a stylish mobile companion. Get the most out of your Cingular service with this impressive quad-band phone.', 'The Moto Razr V3 is expertly crafted to deliver exceptional performance. Inside the ultra-thin design are advanced features like MPEG4 video playback, Bluetooth® wireless technology, a digital camera and more. And with the precision-cut keypad, minimalist styling and metal finish, the V3 looks just as beautiful as it performs. The real difference is in the details. See who’s calling, in color, without opening your phone — the large internal display is complemented by an impressive external display. The precision-cut metal keypad reacts to the lightest of touches. And the features you can''t always see are equally impressive, like quad-band GSM — for global calls where GSM network coverage and roaming agreements are present.', '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), 0);
insert into PRODUCT_TRANSLATIONS (product_id, language, source_lang, description, additional_info, created_by, creation_date, last_updated_by, last_update_date, object_version_id)
values (12, 'DE', 'EN', 'The Creative Nomad MuVo² combines cutting-edge, high-capacity 1-inch hard disk drive storage, high-speed loading, and superb sound quality in a remarkably compact, easy-to-use package. Load up to 2,100 songs (based on 3.5 minutes per song, WMA/64 kbps with 4 GB storage) with simple plug-and-play, drag-and-drop functionality. Transfer any music or data files in a flash with super-fast USB 2.0. Enjoy high-fidelity sound with specifications unmatched by other MP3 and WMA players. The Nomad MuVo² is a perfect blend of capacity, style, versatility, and ease of use in a tiny player for the active music lover. Grab it, load it, and you''re all set to go!', 'The Creative NOMAD MuVo? combines cutting-edge high capacity 1" hard disk drive storage, high-speed loading and superb sound quality in a remarkably compact, easy to use package. Load up to 2100 songs (based on 3.5 min per song, WMA / 64kbps with 4GB storage) with simple plug-and-play, drag-and-drop functionality. Transfer any music or data files in a flash with super fast USB2.0. Enjoy high fidelity sound with specifications unmatched by other MP3 and WMA players. The NOMAD MuVo? is a perfect blend of capacity, style, versatility and ease of use in a tiny player for the active music lover. Grab it, load it, clip it on your belt and you''re all set to go!', '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), 0);
insert into PRODUCT_TRANSLATIONS (product_id, language, source_lang, description, additional_info, created_by, creation_date, last_updated_by, last_update_date, object_version_id)
values (13, 'DE', 'EN', 'SyNEt''s TBW-101UB Bluetooth USB Adapter allows you to make short-range wireless connections between your computer and Bluetooth enabled devices such as Cellular Phone, PDA, and Computer. It is compact and portable, eliminating the need for cables and physical connections between electronic devices. The Bluetooth USB Adapter transmission ensures both protection from interference and secured data transfers. Simply plug the USB Adapter into the USB port and enjoy the freedom and flexibility of Bluetooth wireless technology.', null, '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), 0);
insert into PRODUCT_TRANSLATIONS (product_id, language, source_lang, description, additional_info, created_by, creation_date, last_updated_by, last_update_date, object_version_id)
values (31, 'FR', 'EN', 'The simple to use Kodi EasyShare C743 zoom digital camera provides remarkable features at a reasonable price. You''ll bring details to life with 7.1-megapixel resolution. And the C743 has a 3x optical zoom lens and a huge 2.4-inch color display, proving that impressive doesn''t always need to be expensive.', 'The simple to use Kodak EasyShare C743 zoom digital camera provides remarkable features at a reasonable price. You''ll bring details to life with 7.1 Megapixel and the C743 has a 3x optical zoom lens, huge 2.5 inch color display. Capture life in motion with continuous VGA video 640x480 at 30 fps, featuring audio capture and playback. Create your perfect picture without a computer, using on-camera cropping. Know your pictures are in focus with the blurry picture alert feature. Restore an unintentionally deleted picture with the undo-delete function. Automatically reduce red-eye during picture capture with digital red-eye reduction. The C743 is part of the Kodak EasyShare system, so printing and sharing your pictures is amazingly simple. Shutter speed - 4-1/1400 seconds, long exposure 4 seconds max 2.5 inch LCD indoor/outdoor color display Optical Real Image Viewfinder Self timer - 2 and 10 seconds, 2 shot and burst Scene modes - auto, portrait, sport, landscape, night portrait, snow, beach, fireworks, self portrait, close up, backlight, children, party Still format - JPEG/EXIF v 2.21 QuickTime MOV MPEG-4 format with audio recording during capture NTSC or PAL I/O interface Tripod mount 1/4 inch standard System requirements - Windows XP, 2000 SP4 or later, 600 MHz processor or greater; Internet Explorer 6.0 or higher, Macintosh OS X 10.3 or higher; Safari 1.1 or higher, 128 MB RAM, 200 MB hard drive disk space available, CD-ROM drive, available USB port, color monitor, 800 x 600 display resolution, 16-bit minimum Unit Dimensions - Width 3.6 x Height 2.3 x Depth 1.3 inch, 92.2 x 65.7 x 32.4 mm Weight without batteries - 145 grams (5.1 ounces)', '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), 0);
insert into PRODUCT_TRANSLATIONS (product_id, language, source_lang, description, additional_info, created_by, creation_date, last_updated_by, last_update_date, object_version_id)
values (32, 'FR', 'EN', 'The Pan/Tilt IP Camera is a full-featured surveillance system that provides high quality video over a wireless network connection. Built-in CPU and Web Server allow the camera to function as a standalone device, allowing users to access the camera anywhere in the world by using a Web browser. Users can also move the camera remotely in almost any direction, scanning sensitive locations for unauthorized intrusion. The IP Camera comes with a CMOS sensor to deliver clear and crisp images, and its powerful IPView software gives users enhanced security options to archive streaming video straight to a computer''s hard drive. IP View software can also monitor multiple cameras on a single screen, enable motion detection to trigger automatic recording, and send email alert notification.', null, '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), 0);
insert into PRODUCT_TRANSLATIONS (product_id, language, source_lang, description, additional_info, created_by, creation_date, last_updated_by, last_update_date, object_version_id)
values (33, 'FR', 'EN', 'LG''s newest mobile treat, the VX-8500 Chocolate offers minimalist-inspired style and a silky-smooth slider design. Deluxe features include support for V Cast Music, glowing touch-sensitive navigation keys, a powerful integrated music/video player, a 1.3 megapixel camera/camcorder, stereo Bluetooth capabilities, and a microSD memory slot for extra storage. If you value extreme style mixed with powerful substance, this is the phone for you.', 'So what makes the Chocolate look so great? The touch sensitive keypad controls? The sliding number pad? Slim design? Beautiful screen? From RandB to Heavy Metal to Easy Listening, the Chocolate lets you download from over 1 million songs on the go with V CAST music.', '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), 0);
insert into PRODUCT_TRANSLATIONS (product_id, language, source_lang, description, additional_info, created_by, creation_date, last_updated_by, last_update_date, object_version_id)
values (34, 'FR', 'EN', 'UIX''s A6 cameras come with very advanced features, but at a very affordable price. In addition to the true digital still picture color and sharpness you''d expect from this camera''s 6-megapixel image sensor, you also have a built-in Power Movie Clip function that lets you choose between 30 or 15 frames per second. And, it''s easy to double check your recently shot video with highly convenient pause, fast forward, and/or rewind right in the camera. The A6''s shutter button toggles between capture and playback modes, a great innovation for instant review of the pic you just took. Another one touch button allows you to take charge with manual, aperture priority, and shutter priority modes. Speaking of convenience, there''s even a built in mirror, so you can see how you look when you take your own picture! Select from six different image sizes from 640 by 480 pixels to 2,816 by 2,112 pixels and from three resolution ranges--superfine, fine, and normal for 18 different resolution/size combinations--a useful memory management tool.' || chr(10) || ' For example, you can take a postage stamp size picture from only 1.58 inches away in high resolution for wonderful color printing output, or a large but lower resolution landscape picture for full-screen sharing without choking friends'' e-mail. Samsung''s in-camera editing capabilities include the ability to crop, rotate, and make numerous color revisions. Included are ArcSoft Photo Impression, Digimax Viewer and Digimax Reader software for editing, storage and USB connection output to your PC or directly to your printer via the included USB cable.', null, '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), 0);
insert into PRODUCT_TRANSLATIONS (product_id, language, source_lang, description, additional_info, created_by, creation_date, last_updated_by, last_update_date, object_version_id)
values (35, 'FR', 'EN', 'You''ll be amazed at the small, sleek form factor of the BlackBerry Pearl. It''s like no other BlackBerry. But it''s more than just a new look. This BlackBerry delivers everything its predecessors delivered and a whole lot more. The BlackBerry Pearl offers new features never before seen in a BlackBerry like, a 1.3 mega pixel camera, voice recognition, and an MP3 player to name a few. Try it for a few hours and you are hooked!', null, '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), 0);
insert into PRODUCT_TRANSLATIONS (product_id, language, source_lang, description, additional_info, created_by, creation_date, last_updated_by, last_update_date, object_version_id)
values (36, 'FR', 'EN', 'Nintendo''s Wii video game system (pronounced "we") is designed to attract people, regardless of their age or video game experience, to sit down and play together--whether they''re in the same room or on different sides of the globe. The system''s name reflects this simple idea. It''s easily pronounced in a variety of languages, and the distinctive spelling suggests two players side by side. The two Wii features Nintendo thinks will create new levels of gaming community are built-in Wi-Fi access, supported by a new online gaming service, and Wii''s intuitive, wireless, motion-sensitive game controller.', 'MODEL- WII VENDOR- NINTENDO FEATURES- Wii Console The sleek Wii console, no larger than a stack of several DVD cases, includes Wii Sports, a sensor bar, an AV cable, a Wii stand, a Wii Remote, and a Nunchuk controller for even more exciting game- control possibilities. Featuring a remarkable wireless controller experience, the Nintendo Wii console invites players into game worlds and activities like never before. Whether theyre young or old, expert gamers or beginners, Wii players will express themselves with intuitive motion control using the Wii Remote: a flick of the wrist to swing a baseball bat or tennis racket, a backswing and follow-through to send a golf ball flying over a pristine fairway. Wii Sports, packaged with the Wii console, introduces players to those and many other experiences. Wii also taps into Nintendos unrivaled legacy of great games with the Virtual Console. Connecting via wireless broadband to Nintendo Wi-Fi Connection, Wii owners will be able to spend Virtual Console points to download selected classic games from NES, Super NES and N64 video game consoles. And through WiiConnect24, owners will be able to access even more content. Four-player compatibility as well as the ability to compete with other Wii players over broadband internet means that Wii offers a true social experience. * Design Featuring a compact design that makes it a natural addition to any television setup, the Wii console is white in color and can be displayed either vertically or horizontally. * GameCube Compatibility The Wii is backward-compatible to all Nintendo GameCube games', '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), 0);
insert into PRODUCT_TRANSLATIONS (product_id, language, source_lang, description, additional_info, created_by, creation_date, last_updated_by, last_update_date, object_version_id)
values (37, 'FR', 'EN', 'To make gaming as accessible to people of all ages and all abilities, Nintendo wanted to create a controller that was as inviting as it was sophisticated. The outcome is the Wii Remote controller. Nintendo fused the familiarity of a remote control with the sophistication of motion-sensing technology to come up with an input device for the ages!Sporting the size of a traditional remote control, the wireless Wii Remote controller is a multifunctional device that is limited only by the game designer''s imagination. In a tennis game, it serves as your racket you swing with your arm. In a driving game, it serves as your steering wheel. For first-person shooters, the remote acts as your weapon that you point at an enemy. The list of potential uses goes on and on.Using Bluetooth technology, the wireless Wii Remote controller sends your actions to the Wii console from as far as 30 feet away. As a pointing device, the controller can send a signal from as far as 15 feet away. Up to four Wii Remote Controllers can be connected at once, making for some great multiplayer fun!', null, '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), 0);
insert into PRODUCT_TRANSLATIONS (product_id, language, source_lang, description, additional_info, created_by, creation_date, last_updated_by, last_update_date, object_version_id)
values (38, 'FR', 'EN', 'EJB 3.0 has made huge advances in ease of development, and its drastically simplified programming model has been widely acclaimed. Targeted at Java and J2EE developers both with and without prior EJB experience, Beginning EJB 3 Application Development takes readers through the details of the EJB 3.0 architecture, and shows how EJB can be used to develop powerful, standards-based backend business logic. With 12 years of combined EJB experience, the authors offer many practical insights into the entire EJB architecture and cover all areas of the EJB 3.0 specification', null, '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), 0);
insert into PRODUCT_TRANSLATIONS (product_id, language, source_lang, description, additional_info, created_by, creation_date, last_updated_by, last_update_date, object_version_id)
values (39, 'FR', 'EN', 'EJB 3.0 sets a new precedent. It has made huge advances in ease of development, and its drastically simplified programming model has been widely acclaimed. This book is the definitive guide to EJB 3.0 persistence technology. The authors provide unparalleled insight and expertise on this topic, fully examining and explaining EJB 3.0 persistence specification. They describe how to use this sophisticated technology to its full potential', null, '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), 0);
insert into PRODUCT_TRANSLATIONS (product_id, language, source_lang, description, additional_info, created_by, creation_date, last_updated_by, last_update_date, object_version_id)
values (40, 'FR', 'EN', 'Get a thorough understanding of Oracle Database 10g from the most comprehensive Oracle database reference on the market, published by Oracle Press. From critical architecture concepts to advanced object-oriented concepts, this powerhouse contains nearly 50 chapters designed to enlighten you. Upgrade from earlier versions, use SQL, SQL Plus, and PL/SQL. Get code examples and access popular documentation PDFs--plus a full electronic copy of the book on the included CD-ROM.' || chr(10) || ' Go beyond the basics and learn security, text searches, external tables, using Java in Oracle, and a great deal more', null, '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), 0);
insert into PRODUCT_TRANSLATIONS (product_id, language, source_lang, description, additional_info, created_by, creation_date, last_updated_by, last_update_date, object_version_id)
values (41, 'FR', 'EN', 'EJB 3 in Action tackles EJB 3 and the Java Persistence API head-on, providing practical code samples, real-life scenarios, best practices, design patterns, and performance tuning tips. This book builds on the contributions and strengths of seminal technologies like Spring, Hibernate, and TopLink. EJB 3 is the most important innovation introduced in Java EE 5.0. EJB 3 simplifies enterprise development, abandoning the complex EJB 2.x model in favor of a lightweight POJO framework. The new API represents a fresh perspective on EJB without sacrificing the mission of enabling business application developers to create robust, scalable, standards-based solutions. EJB 3 in Action is a fast-paced tutorial, geared toward helping you learn EJB 3 and the Java Persistence API quickly and easily. For newcomers to EJB, this book provides a solid foundation in EJB. For the developer moving to EJB 3 from EJB 2, this book addresses the changes both in the EJB API and in the way the developer should approach EJB and persistence. ', null, '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), 0);
insert into PRODUCT_TRANSLATIONS (product_id, language, source_lang, description, additional_info, created_by, creation_date, last_updated_by, last_update_date, object_version_id)
values (42, 'FR', 'EN', 'It is not possible to fit 36 Bach masterpieces on two CDs, so what Essential Bach does is present individual movements from across a range of the composer''s work. The anthology is clearly aimed at the newcomer, and the absence of booklet notes to put the music in context is disappointing. We are only given titles, performers, and what films the extracts have been featured in, from Rollerball to The English Patient. On the plus side, most if not all of the music is instantly recognizable, by melody if not by name. Everything from the Brandenburg Concertos to "Air on a G String" to the B Minor Mass and St. Matthew Passion is represented. Performances range from 1960 to 1993, encompassing both early instrument and modern orchestra interpretations by a wide variety of forces, including Sir Neville Marriner with the Academy of St. Martin in the Fields and Raymond Leppard leading the English Chamber Orchestra. Given such diversity the result is unavoidably a patchwork, albeit one made from the finest materials, and as such is perhaps best treated as a sampler to aid exploration of the vast legacy of one of the very greatest composers who ever lived. ', null, '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), 0);
insert into PRODUCT_TRANSLATIONS (product_id, language, source_lang, description, additional_info, created_by, creation_date, last_updated_by, last_update_date, object_version_id)
values (43, 'FR', 'EN', 'These are thoroughly balanced and lovingly conceived performances. They reveal great strength of character, healthy self-control and mature insight. Ferencsik evidently had experienced much, with emotional and spiritual roots that went deep. Consequently he had no need to resort to surface, superficial excitement to compensate for lack of insight. Ferencsik reveals the mature insight that comes only from a life-long contemplation of scores that the conductor knew as well as he knew the date of his own birthday.', null, '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), 0);
