insert into PRODUCT_TRANSLATIONS (product_id, language, source_lang, description, additional_info, created_by, creation_date, last_updated_by, last_update_date, object_version_id)
values (44, 'FR', 'EN', 'This 2CDs set is quite a good compilation of arias from Mozart''s best known operas. The cast is awesome, too. The trouble is Mozart wrote so many wonderful arias that when you try to compile them from many operas, lots of the great ones like ''Non piu di fiori'' and ''Deh per questo istante solo'' from La clemenza di Tito get left out (tho having Teresa Berganza''s version of ''Parto ma tu ben mio'' makes up for it somewhat). A lot of chorus pieces from Idomeneo but none of Idamante''s arias, no Elettra''s famous rage aria, and no ''Traurigkeit'' from ''Die Entfuehrung''? Bottom line, all the arias included are marvellously sung. I think the line up could have been better, tho. It won''t fill you up, perhaps, but it will wet your appetite for complete set of the operas included.', null, '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), 0);
insert into PRODUCT_TRANSLATIONS (product_id, language, source_lang, description, additional_info, created_by, creation_date, last_updated_by, last_update_date, object_version_id)
values (45, 'FR', 'EN', 'In this recording we hear one of the great piano performers in Vladimir Ashkenazy playing pieces from one of the greatest piano composers in Fryderyk Chopin; with the utmost quality in recorded sound. And if one needs more convincing, you get two hours of music for the price of one cd. Hard to find a better buy in classical music. Moreover, this cd not only looks good on paper, but it also is one of my favorites to listen to. I usually listen to music to help enrich and exonerate an otherwise mundane (computer) task, and I find myself stopping work several times each listen because I''m overcome by the beauty of these pieces, and the both spirited and soulful playing of Ashkenazy. For anyone new to Chopin, I cannot think of a better starting point (no, this double cd does not cover all his great compositions!) than this recording.', null, '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), 0);
insert into PRODUCT_TRANSLATIONS (product_id, language, source_lang, description, additional_info, created_by, creation_date, last_updated_by, last_update_date, object_version_id)
values (46, 'FR', 'EN', 'We haven''t had a disc of Tchaikovsky ballet excerpts from the Vienna Phil., I believe, since Karajan''s four decades ago (a great recording on Decca in plush remastered sound). Here under James Levine in 1992 the orchestra is even better--more fluid, sparkling and alive than under Karajan. This is well-worn music that every collector already owns, and it''s easy to overlook Levine as a Tchaikovsky conductor.' || chr(10) || ' Here he defies all expectations. True, he doesn''t take a balletic aproach. Levine''s tempos in general are too fast to dance to. But in the symphonic vein he has chosen, Levine works miracles. The urgent virtuosity of the playing--aided by excellent recorded sound--is jaw-dropping, and the violin soloist in the long Swan Lake scene (#4) is beyond compare for delicacy and poetry. Karajan''s only fault in this music wass to blow it up out of proportion; Previn''s was to apply routine phrasing.' || chr(10) || ' Levine makes these suites totally riveting and sensuously luxurious without any trace of pomposity. Highly recommended.', null, '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), 0);
insert into PRODUCT_TRANSLATIONS (product_id, language, source_lang, description, additional_info, created_by, creation_date, last_updated_by, last_update_date, object_version_id)
values (47, 'FR', 'EN', 'CD 1 THE THREE GREAT SYMPHONIES CD 1 Symphony No. 7 in D Minor, Op. 70 q. I. Allegro maestoso 2. Poco adagio 3. Scherzo: Vivance 4. Finale: Allegro Symphony No. 8 in G Mahor, Op. 88 5. Allegro con brio 6. Adagio 7. Allegretto grazioso 8. Allegro, ma non troppo CD 2. Symphony No. 9 in E Minor, Op. 95 1. Adagio; allegro molto 2. Largo 3. Scherzo: Molto vivace 4. Alllegro con fuoco 5. Scherzo capriccioso, Op. 66.', null, '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), 0);
insert into PRODUCT_TRANSLATIONS (product_id, language, source_lang, description, additional_info, created_by, creation_date, last_updated_by, last_update_date, object_version_id)
values (19, 'DE', 'EN', 'Apple iPod - Continuing its tradition of hardware and software innovation and design, Apple has released a new iPod that surpasses the last. This update to the 5th generation iPod with video playback features a huge 80GB hard drive - the largest yet! With iTunes 7 ushering in movie and game downloads, there''s more than enough content to satisfy this beast of a media player. You also get a 2.5" display that is now 60% brighter, a higher capacity battery for up to 20 hrs. of music and 6.5 hrs. of video, and a set of newly designed iPod earbuds. Ports - dock connector, Stereo minijack, composite video and audio through minijack Connectivity - USB through dock connector, composite video (with A/V cable - sold separately), and audio through headphone jack or line out on the iPod Universal Dock (sold separately) Charge Time - about 4 hrs. (2 hrs. fast charge to 80% capacity) Audio Support - AAC (16 to 320 Kbps), Protected AAC (from iTunes Music Store), MP3 (16 to 320 Kbps), MP3 VBR, Audible (formats 2, 3, and 4), Apple Lossless, WAV, and AIFF Photo Support - syncs iPod-viewable photos in JPEG, BMP, GIF, TIFF, PSD (Mac only), and PNG formats Video Support - H.264 video - up to 768 Kbps, 320 x 240, 30 fps, Baseline Profile up to Level 1.3 with AAC-LC up to 160 Kbps, 48 Khz, stereo audio in. m4v,. mp4 and. mov file formats / MPEG-4 video - up to 2.5 mbps, 480 x 480, 30 fps, Simple Profile with AAC-LC up to 160 Kbps, 48 Khz, stereo audio in. m4v,. mp4 and. mov file formats Backlight Timer Sleep Timer 20 Equalizer Settings Shuffle Songs or Albums Date and Time Unit Dimensions - 4.1 x 2.4 x 0.55 Unit Weight - 5.5 oz.', null, '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), 0);
insert into PRODUCT_TRANSLATIONS (product_id, language, source_lang, description, additional_info, created_by, creation_date, last_updated_by, last_update_date, object_version_id)
values (31, 'DE', 'EN', 'The simple to use Kodi EasyShare C743 zoom digital camera provides remarkable features at a reasonable price. You''ll bring details to life with 7.1-megapixel resolution. And the C743 has a 3x optical zoom lens and a huge 2.4-inch color display, proving that impressive doesn''t always need to be expensive.', 'The simple to use Kodak EasyShare C743 zoom digital camera provides remarkable features at a reasonable price. You''ll bring details to life with 7.1 Megapixel and the C743 has a 3x optical zoom lens, huge 2.5 inch color display. Capture life in motion with continuous VGA video 640x480 at 30 fps, featuring audio capture and playback. Create your perfect picture without a computer, using on-camera cropping. Know your pictures are in focus with the blurry picture alert feature. Restore an unintentionally deleted picture with the undo-delete function. Automatically reduce red-eye during picture capture with digital red-eye reduction. The C743 is part of the Kodak EasyShare system, so printing and sharing your pictures is amazingly simple. Shutter speed - 4-1/1400 seconds, long exposure 4 seconds max 2.5 inch LCD indoor/outdoor color display Optical Real Image Viewfinder Self timer - 2 and 10 seconds, 2 shot and burst Scene modes - auto, portrait, sport, landscape, night portrait, snow, beach, fireworks, self portrait, close up, backlight, children, party Still format - JPEG/EXIF v 2.21 QuickTime MOV MPEG-4 format with audio recording during capture NTSC or PAL I/O interface Tripod mount 1/4 inch standard System requirements - Windows XP, 2000 SP4 or later, 600 MHz processor or greater; Internet Explorer 6.0 or higher, Macintosh OS X 10.3 or higher; Safari 1.1 or higher, 128 MB RAM, 200 MB hard drive disk space available, CD-ROM drive, available USB port, color monitor, 800 x 600 display resolution, 16-bit minimum Unit Dimensions - Width 3.6 x Height 2.3 x Depth 1.3 inch, 92.2 x 65.7 x 32.4 mm Weight without batteries - 145 grams (5.1 ounces)', '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), 0);
insert into PRODUCT_TRANSLATIONS (product_id, language, source_lang, description, additional_info, created_by, creation_date, last_updated_by, last_update_date, object_version_id)
values (32, 'DE', 'EN', 'The Pan/Tilt IP Camera is a full-featured surveillance system that provides high quality video over a wireless network connection. Built-in CPU and Web Server allow the camera to function as a standalone device, allowing users to access the camera anywhere in the world by using a Web browser. Users can also move the camera remotely in almost any direction, scanning sensitive locations for unauthorized intrusion. The IP Camera comes with a CMOS sensor to deliver clear and crisp images, and its powerful IPView software gives users enhanced security options to archive streaming video straight to a computer''s hard drive. IP View software can also monitor multiple cameras on a single screen, enable motion detection to trigger automatic recording, and send email alert notification.', null, '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), 0);
insert into PRODUCT_TRANSLATIONS (product_id, language, source_lang, description, additional_info, created_by, creation_date, last_updated_by, last_update_date, object_version_id)
values (33, 'DE', 'EN', 'LG''s newest mobile treat, the VX-8500 Chocolate offers minimalist-inspired style and a silky-smooth slider design. Deluxe features include support for V Cast Music, glowing touch-sensitive navigation keys, a powerful integrated music/video player, a 1.3 megapixel camera/camcorder, stereo Bluetooth capabilities, and a microSD memory slot for extra storage. If you value extreme style mixed with powerful substance, this is the phone for you.', 'So what makes the Chocolate look so great? The touch sensitive keypad controls? The sliding number pad? Slim design? Beautiful screen? From RandB to Heavy Metal to Easy Listening, the Chocolate lets you download from over 1 million songs on the go with V CAST music.', '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), 0);
insert into PRODUCT_TRANSLATIONS (product_id, language, source_lang, description, additional_info, created_by, creation_date, last_updated_by, last_update_date, object_version_id)
values (34, 'DE', 'EN', 'UIX''s A6 cameras come with very advanced features, but at a very affordable price. In addition to the true digital still picture color and sharpness you''d expect from this camera''s 6-megapixel image sensor, you also have a built-in Power Movie Clip function that lets you choose between 30 or 15 frames per second. And, it''s easy to double check your recently shot video with highly convenient pause, fast forward, and/or rewind right in the camera. The A6''s shutter button toggles between capture and playback modes, a great innovation for instant review of the pic you just took. Another one touch button allows you to take charge with manual, aperture priority, and shutter priority modes. Speaking of convenience, there''s even a built in mirror, so you can see how you look when you take your own picture! Select from six different image sizes from 640 by 480 pixels to 2,816 by 2,112 pixels and from three resolution ranges--superfine, fine, and normal for 18 different resolution/size combinations--a useful memory management tool.' || chr(10) || ' For example, you can take a postage stamp size picture from only 1.58 inches away in high resolution for wonderful color printing output, or a large but lower resolution landscape picture for full-screen sharing without choking friends'' e-mail. Samsung''s in-camera editing capabilities include the ability to crop, rotate, and make numerous color revisions. Included are ArcSoft Photo Impression, Digimax Viewer and Digimax Reader software for editing, storage and USB connection output to your PC or directly to your printer via the included USB cable.', null, '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), 0);
insert into PRODUCT_TRANSLATIONS (product_id, language, source_lang, description, additional_info, created_by, creation_date, last_updated_by, last_update_date, object_version_id)
values (35, 'DE', 'EN', 'You''ll be amazed at the small, sleek form factor of the BlackBerry Pearl. It''s like no other BlackBerry. But it''s more than just a new look. This BlackBerry delivers everything its predecessors delivered and a whole lot more. The BlackBerry Pearl offers new features never before seen in a BlackBerry like, a 1.3 mega pixel camera, voice recognition, and an MP3 player to name a few. Try it for a few hours and you are hooked!', null, '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), '0', to_date('28-09-2013 20:54:44', 'dd-mm-yyyy hh24:mi:ss'), 0);
